INSERT INTO `respuestas` VALUES (1,1,15,'Gracias a ti por confiar en nosotros'),(2,2,15,'Gracias a ti por confiar en nosotros'),(3,3,15,'Gracias a ti por confiar en nosotros'),(4,4,15,'Gracias a ti por confiar en nosotros'),(5,5,164,'Hola Eva, muchas gracias por tu comentario. Agradecemos tu confianza y nos alegra saber que tu experiecia con Isaac esta siendo satisfactoria. Un placer poder ayudarte'),(6,6,154,'Gracias por tus palabras llenas de aprecio y gratitud. Estamos felices de haber podido acompañarte en tu camino. Valoramos tu confianza y te agradecemos por compartir tu experiencia con nosotros. Estamos aquí para brindarte el apoyo que necesites.'),(7,7,155,'Muchas gracias por su comentario. Nos encanta ver que nuestro psicólogo Isaac le transmite en terapia profesionalidad y seguridad, acompañándola en su proceso.'),(8,8,156,'Muchas gracias por su comentario. Estamos encantados de que nuestro psicólogo le esté ayudando en su proceso terapéutico, brindándole un trato cercano y familiar.'),(9,9,157,'Muchas gracias por su comentario. Nos alegra ver que la terapia con nuestro psicólogo le está ayudando a encontrarse a sí mismo.'),(10,10,158,'Gracias por tu reseña positiva. Nos alegra saber que tu primera experiencia al buscar a un psicólogo fue exitosa con Isaac Quirós. Gracias por confiar en nosotros y por tu recomendación.'),(11,11,159,'Muchas gracias por su comentario. Desde PsicoAbreu nos alegra saber que nuestro psicólogo Isaac le brinda con profesionalidad la atención que merece.'),(12,12,160,'Muchas gracias por su comentario. Estamos encantados de saber que su experiencia con nosotros ha sido excelente.'),(13,13,161,'Muchas gracias por su comentario. Nos encanta recibir su experiencia y conocer que su terapia le hayan ayudado a conseguir su bienestar.'),(14,14,162,'Muchas gracias, por aportar su experiencia y mención a nuestros psicólogos.'),(15,15,163,'Muchas gracias por su aportación. Para nosotros es un placer conocer su experiencia y saber que ha quedado satisfecho con su terapia.'),(16,16,165,'Muchas gracias por su comentario. Nos alegra saber que su experiencia con nosotros ha sido excelente, y su terapia esté siendo de gran ayuda.'),(17,17,166,'Muchas gracias por su aportación. Nos alegra saber que se siente cómodo con nuestro psicólogo y que le está ayudando en su proceso terapéutico.'),(18,18,154,'Muchas gracias por su comentario. Nos alegra saber que la atención en su terapia esté dando sus frutos. Tu bienestar es nuestra prioridad.'),(19,19,155,'Muchas gracias por su comentario. Nos complace mucho saber que su terapia sea efectiva y satisfactoria.'),(20,20,156,'Gracias por tus palabras. Nos complace saber que su trato y profesionalidad han sido de tu agrado. Apreciamos tus comentarios positivos.'),(21,21,157,'Muchas gracias por su comentario. Nos alegra saber que su experiencia haya sido tan satisfactoria y le haya ayudado a tomar las riendas de su vida. En referencia a la sugerencia que nos hace del datáfano, para el pago de sus sesiones, puede dirigirse a directamente a su psicóloga.'),(22,22,158,'Muchas gracias por su aportación. Estamos encantados de saber que su experiencia con nosotros y ha sido excelente.'),(23,23,159,'Muchas gracias por su comentario. Nos complace saber que ha quedado satisfecho con el trato recibido.'),(24,24,160,'Muchas gracias por su aportación. Nos alegra saber que su terapia la han ayudado a mejorar su salud y su vida.'),(25,25,161,'Muchas gracias por su comentario. Nos complace saber que ha recibido un buen trato y que le haya servido para mejorar y avanzar en su bienestar.'),(26,26,162,'Muchas gracias por su comentario. Nos satisface conocer que está satisfecho con el trato recibido.'),(27,27,163,'Muchas gracias por su comentario. Nos complace saber que ha tenido un trato excelente en su terapia.'),(28,28,164,'Muchas gracias por su aportación. Nos complace saber que está satisfecho con la atención recibida en terapia.'),(29,29,165,'En nuestra base de datos no aparece ningún paciente con su nombre. Quedamos a tu entera disposición a través del correo para que puedas ampliar tu información y poder valorar tu caso.'),(30,30,167,'¡Muchas gracias por tus palabras! Nos encanta leerte y ver cómo tu experiencia ha sito tan buena entre nosotros. ¡Enhorabuena por tu aprobado! Ahora a disfrutarlo. ¡Ésta siempre será tu casa!'),(31,31,154,'¡Buenos días! Gracias por tus palabras. Le encanta lo que hace y eso se ve reflejado en su profesionalidad y en vuestros resultados. ¡Enhorabuena por tu C en Aptis! ¡Esperamos verte pronto! ¡Vuelve cuando quieras! Un beso enorme.'),(32,32,155,'¡Qué felicidad leerte! Ha sido un placer tenerte entre nosotros. Como bien dices, Manolo y Juan son dos pedazos de profesionales y dos personas excelentes. Implicadas con vosotros no sólo a nivel académico, sino también personal. Intentamos ser una gran familia para todo el que pasa por aquí y acompañar en lo máximo posible en este camino hacia el objetivo. Nos alegra ayudaros a conseguirlo y estar presentes y formar parte de vuestro éxito. Ésta siempre será tu casa. ¡Te esperamos con los brazos abiertos!'),(33,33,156,'¡¡¡Enhorabuena primero Yolanda por tu plaza bien merecida!!!  '),(34,34,157,'Buenos días. En primer lugar, te recordamos que tal y como se acuerda y firma en el momento de la inscripción en ambos documentos (hoja de inscripción y contrato) se ha de avisar diez días antes de que acabe el mes formalmente de la baja al centro. Tú comunicaste que no vendrías durante las dos primeras semanas del mes por asuntos personales, eso no es tramitar una baja, para la cual hay que rellenar otro documento. Por lo tanto has estado dado de alta en la plataforma -con las clases y los documentos- y en el grupo de WhatsApp de trabajo teniendo acceso a todo el material y la información necesaria para tus clases. Las clases se van adaptando al grupo y hay clases más gramaticales y otras en las que se trabaja más la parte práctica: speaking, writting... Tu intención era incorporarte la tercera semana de febrero, si tenías pensado continuar, no estarías tan descontento, o al menos no nos lo has transmitido, cosa que podrías y deberías haber hecho en el caso de que fuera así, para adaptarnos lo mejor posible a tus necesidades, tanto la academia como la profesora. Hasta esta reseña no habíamos recibido queja alguna y, como hemos resaltado anteriormente, tenías intención de continuar. Lamentamos tu experiencia. Evidentemente, todo el mundo tiene derecho a tener una opinión propia, nos extraña el cambio repentino, eso sí. Lo que sí te decimos es que hablar de estafa es una acusación muy seria, por lo tanto, te invitamos o bien a denunciarnos formalmente sin problema o a quitar dicha acusación, porque si no, seremos nosotros los que tomemos medidas legalmente por este hecho. Te deseamos que tengas un buen día.'),(35,35,158,'¡¡ Ole ole y olé!! Primero, ¡enhorabuena! No sabes la alegría tan grande que tenemos, y leer tu comentario la verdad que nos hemos emocionado (vamos, que se me han saltado las lágrimas). Gracias a ti por ser tan genial y ahora a disfrutar de tu nueva vida, qué bien te lo has currado. Ya sabes que aquí todos somos un equipo, cada uno aporta su granito de arena para que se os haga mas ameno el estudio y con respecto a Lorena, ¡¡es la caña!!, curra a la par vuestra. Un besote muy grande y ya nos vas contando que destino te toca. Has entrado el 2023 con el pie derecho jajajaja, disfrútalo.'),(36,36,159,'Madre, que cosa mas bonitas nos dices. Primero, enhorabuena por tus plazas, que eres muy modesta, que te han caído mas de una jejeje. Para nosotros ha sido un placer de tenerte, ya que eres una persona excepcional, te mereces esos resultados que te lo has currado tela. Con respecto a la academia, leerte nos satisface como tu dices al 200%, porque vemos que transmitimos lo que queremos, eso nos llena. Con respecto a Miguel tu preparador del SAS, no lo has podido describir mejor, es muy meticuloso con su trabajo y siente verdadera vocación por la docencia, se le nota en sus clases. Vuestros éxitos son un poquito suyos, que es lo que se pretende. Se alegra como si lo hubiese conseguido él. Esta próxima convocatoria como en la anterior hacemos pleno, tú ya lo sabes por ti y tus compañer@s. Un besote enorme y ahora a hacer una hoguera con los apuntes y disfrutar de tu plaza, tranquilidad y trabajo, muy importante con Carlos que ha sido otro apoyo incondicional tuyo. Un besote muy gordo y mil gracias por tu reseña.'),(37,37,160,'¡Hola! ¡Gracias por tus palabras! Qué gusto leer tu reseña. No has podido describir mejor a Elle, ¡es maravillosa! Qué alegría saber que estáis contentos con nuestros profesores y también con nosotros. ¡Se trata de que os sintáis en familia y qué consigáis vuestros objetivos! Un beso abrazo enorme de parte de todos. ¡Pasa cuando quieras a saludarnos!'),(38,38,161,'Primero y lo mas importante. ¡¡ENHORABUENA POR TU PLAZA!! Tienes que estar en una nube, pues sin haber trabajado en lo publico, sacarte la plaza es un lujo, y por su puesto un trabajo duro por tu parte. Tus notas han sido espectaculares y como bien dices el trabajo de vuestro preparador Miguel, que ha estado más que atento al grupo, sin descuidaros ni un momento. La verdad vuestras notas han sido maravillosas y habéis hecho un buen equipo de trabajo. Miguel es muy metódico, trabajador y competente, y en los resultados se refleja el trabajo de todo el curso. Ahora a disfrutar de tu merecido verano, nosotros muy orgullosos y contentos con tu plaza. Un besote muy grande y ahora a ver donde te destinan ya nos vas diciendo. Enhorabuena de nuevo. Feliz y merecido verano!'),(39,39,162,'¡Muchas gracias por tu reseña! Es un gusto leerte. Para nosotros es esencial que os sintáis en familia, trabajamos por vosotros, para ayudaros a cumplir vuestros objetivos, apoyándoos y acompañándoos en el camino. Lidia, tu preparadora de PT es una maravilla: entregada, competente, implicada... al cien por cien con vosotros. No podemos tener a una preparadora mejor. ¡Gracias por elegirnos y te esperamos siempre con los brazos abiertos! ¡Ésta es tu casa!'),(40,40,163,' muchísimas gracias por tu reseña. Ha sido poquito tiempo pero intenso, ya que eres un torbellino y todos los viernes cuando entrabas por la academia; entraba la alegría, porque derramas \"jarte\" por donde vas pasando. Sentimos mucho que lo hayas tenido que dejar, pero las razones de peso, son las que nos mueven a todo. Tu grupo te va a echar de menos, nosotros te vamos a echar de menos. Jose te va a echar de menos y cierto es que él está pendiente de todos y cada uno de vosotros, pues su objetivo es vuestra plaza, en su trabajo se ve. Cuenta que para la siguiente si todo lo tienes listo. Aquí nos tienes para que te prepares con nosotros, y encantados de tenerte de nuevo. Nos debes una visita pronto para saludarte y nos cuentes como vas. Un besote muy grande, que eres un solete. Cuidate'),(41,41,164,'¡Muchísimas gracias! ¡Qué alegría leerte! Enhorabuena por tu plaza, nos hace muy felices acompañaros en vuestro camino hasta alcanzar vuestro objetivo. Ahora a disfrutar.'),(42,42,165,'¡Enhorabuena, por tu pedazo de nota! ¡Muchísimas gracias por tu comentario! Como bien dices, Cynthia es una pedazo de profesora de francés, se implica y está muy pendiente de todos vosotros. Os hace trabajar para que saquéis vuestro título. ¡Te puedo garantizar que no ha suspendido ningún alumno de todos los que se han presentado, entre ellos tú! Hace que os resulte fácil estudiar el idioma. Además, como suspenda algún alumno, le daría depresión, rompería su estadística, jejeje. ¡Un besito y buen verano, guapísima! A ver si te animas para el C1.'),(43,43,166,'¡¡¡Ole!!!! Mil gracias por tu reseña, y enhorabuena por tus notas de Infantil, tienes una pedazo de preparadora y habéis trabajado todas tela, jejeje no os dejaba que os despistarais ni un segundo. A ve cuando salga ya las notas finales de todo, ojala que tengas tu plaza. Ya sabes que son muchas horas juntos, y esto es como una pequeña gran familia, estamos todos para todos (como los mosqueteros), así se lleva el trabajo mejor. Un besote muy grande y ahora disfruta del verano y tu peque, que bien merecido lo tienes. Nos debes una visita.'),(44,44,167,'Leerte me ha emocionado. Habéis sido un grupo genial, y nosotros, no hemos hecho mas que lo que nos gusta, estar pendientes a vosotros, porque es lo que os merecéis. Enhorabuena a ti por tus notas que han sido excelentes. Y con respecto a vuestra preparadora Lidia, como bien lo has dicho, lo ha dado todo en cada clase, y ha estado pendiente de cada uno de vosotros, además de con su gran trabajo con su gran cariño es sin exagerar excepcional. \"Si es que los chic@s de PT sois de otra madera\" Un besote grandísimo, mil gracias por tu comentario. Nos debes una visita.'),(45,45,154,'Jose, es un auténtico profesional, cercano, trabajador e implicado con su trabajo y con vosotros, por supuesto. ¡Nos encanta que te hayas llevado esa impresión de nosotros! Trabajamos para que estéis contentos, acompañaros en vuestro camino y ayudaros así a conseguir a vuestros objetivos. Es un placer hacerlo y si, además, vemos que lo agradecéis y lo valoráis. ¡Doblemente! ¡Un abrazo enorme y te esperamos por aquí cuando quieras!'),(46,46,155,'Ole ole y Olé. Enhorabuena por tu plaza, que estamos contentísimos, además que te ha tocado cerquita, ( pedazo de nota). Muchas gracias por tus comentarios, ya sabes que nos gusta nuestro trabajo y conoceros a todos los que estáis en la Academia, y de tu preparadora de Agente de Hacienda , sin comentarios jejeje, lo da todo en cada clase y os da mucha caña, ya que para ella vuestra plaza es su objetivo, trabaja mucho y le gusta que vosotros también trabajéis. Un besote muy gordo, disfruta de tu nueva posición y ya sabes nos debes una visita.'),(47,47,156,'¡¡¡Enhorabuena Juan Carlos por tu plaza de Profe de Matemáticas!!. Eso es lo que te tengo que poner en primer lugar, ya que te ha cambiado la vida por completo jejeje y merecida que la tienes. Muchísimas gracias por tu reseña, eres un sol. Por la parte que le toca a la academia agradecidísima, soy como me dicen algunos alumnos mama pollito, siempre pendiente y me sale solo. Y con respecto a los dos preparadores de Matemáticas que has tenido, lo han dado todo en cada clase, además de la atención durante toda la semana de Maria, que no os ha dejado ni  un momento. El resultado del trabajo en equipo, se ha visto con vuestras plazas. Así que me debes una visita y mi Japonesa jajajaja.   Un besote'),(48,48,157,'¡Hola! Alex es una maravilla, no has podido describirlo mejor. Nos encanta leer este comentario contando tu experiencia, ¡ha sido más que un placer tenerte entre nosotros! ¡Esperamos tu visita! ¡Mil gracias! '),(49,49,158,'Ole, ole y olé. Enhorabuena, primero, por tu notaza que ha sido maravillosa. Vamos, que te quedas donde pidas destino fijo Sr Funcionario de AAIIPP. Ha sido todo un placer tenerte con nosotros y estamos muy orgullosos de tu plaza. Gracias por tu comentario y con respecto a la preparadora, cierto que lo da todo en cada clase y esta pendiente de todos sus alumnos, es exigente y eso es bueno para vosotros. Nos debes la visita reglamentaria para darte la enhorabuena en persona. Un beso muy grande y mil gracias por todo.'),(50,50,159,'¡¡Gracias Marta por tu reseña!! Primero en contestación darte la enhorabuena por tus notas , que han sido espectaculares. Has trabajado mucho, así que siéntete muy orgullosa. Con respecto a Mamen, como bien dices, es de vocación, todo lo que hace, le sale del corazón, mejor profe de Infantil ni preparadora imposible, jejeje, y no exagero ni un ápice. Le va a encantar tu reseña, igual que nos ha encantado a nosotros, eres un amor. Ahora a disfrutar de tu verano, y con ganas de verte por aquí. Así que ya sabes te toca, una visita obligada. Un super besote muy muy grande.'),(51,51,160,'¡Ole mi Carlos! Cuando te vea, vamos que te como a besos. Mil gracias por tu reseña. Habéis sido un grupo de trabajo de Primaria PT maravilloso, y vuestros resultados espectaculares, para ser la primera vez que os presentáis, notas de lujo. Vuestra preparadora lo más, pendiente siempre de vosotros en cada momento, ha estado siempre a la par vuestra, como yo le digo, \"vuestra mama pollito\". Tenerte con nosotros ha sido todo un lujo. Nos debes una visita y ahora a disfrutar de tu verano, que bien merecido lo tienes. UN SUPER BESO'),(52,52,161,'Gracias Nuria por tu comentario, y enhorabuena por tu aprobado. Ha sido un buen grupo de trabajo, y en las notas tuyas y de tus compañeros se ve. Alejandro como bien dices, ha estado pendiente en cada momento de cada uno de vosotros, es genial y le gusta lo que hace. En cada clase transmite tanta energía positiva que os contagiaba a todos. Un besito muy grande y espero que estés disfrutando del verano ya que te lo mereces. Nos debes una visita!'),(53,53,162,'¡Buenas tardes! ¡Qué alegría leerte, tus palabras no pueden describir mejor a nuestra profe! Ella es única y trabaja de una forma increíble, sois lo primero y se ve en los resultados. ¡Gracias por contar tu experiencia con nosotros! ¡Te esperamos siempre con los brazos abiertos!'),(54,54,163,'Estamos muy agradecidos por tu comentario, y si sigues trabajando y estudiando, dejándote de llevar por Miriam que explicando y dando la clase  hace que lo entendáis todo a la primera, además de dar caña tela, jejeje. Ya mismo consigues tu sueño, y nosotros estaremos ahí contigo hasta el ultimo momento, eso sin duda. Encantados de tenerte con nosotros. Un besote.'),(55,55,164,'Nos alegra muchísimo leerte y saber que has estado bien entre nosotros. Ha sido un placer tenerte en nuestra academia.  Y tienes toda la razón, ¡Pablo es una maravilla! Esperamos tu visita. ¡Un abrazo enorme!'),(56,56,165,'No nos consta ninguna queja por parte del alumno mencionado, de todas formas, estamos encantados de atenderte de forma presencial o por email en el caso que quieras que veamos tu caso en concreto. Un saludo'),(57,57,166,'Primero ¡¡ENHORABUENA POR TU PLAZA DE PROFE!! Muchísimas gracias Lorena por tu comentario, decirte que tenemos que juntarnos para celebrarlo. Hemos visto cada semana tu esfuerzo y por supuesto el de Jose Carlos que no ha parado ni un segundo con cada uno de vosotros. Sabes que nos alegramos muchísimo por ti ya que te lo mereces. Un besazo y ahora disfruta de tu merecido verano.'),(58,58,167,'¡Muchas gracias, Antonio! Nos encanta leer vuestras reseñas y ver como el trabajo y la vocación os llega y da sus frutos. ¡Felices Fiestas! '),(59,59,154,' Pedazo de reseña, acabo de leerla, por eso no te he contestado antes. Primero enhorabuena por tus dos notas, tanto de Auxiliar como de Administrativo porque te lo has currado bien, y segundo, mil gracias por tu comentario. Vamos me has dejado sin palabras, con respecto a Miguel, mejor no lo has podido describir, disfruta con su trabajo , dando sus clases y eso os lo trasmite a vosotros para que estéis super motivados siempre. Y por la parte que nos toca encantados, no os merecéis menos; pasamos muchas horas juntos y mejor estar a gusto y venir con ganas cada semana. Por ultimo y no menos importante, nos debes una visita y por supuesto tomarnos algo. ¿No te parece? Un besote muy grande.'),(60,60,155,'¡¡¡ENHORABUENA!!! Ya sabes que tu alegría es compartida al 100% por todos nosotros. No se ni que contestarte al pedazo de reseña que has puesto. Los profes emocionados al leerte ya te imaginas y muy orgullosos de ti. Ya son compañeros jejeje cambia la cosa. La verdad que hay un grupo de trabajo muy bueno tanto por vuestra parte como por la de ellos. Y por parte nuestra como academia, ha sido todo una satisfacción tenerte como alumno y formar parte de nosotros, conocerte lo más, ya que eres un encanto (esto que no se entere mi media naranja jejejeje) Deseando verte en persona para felicitarte y ya sabes, queremos foto de uniforme. Un beso muy grande y mil gracias.'),(61,61,156,'Muchas Gracias por tu comentario. Nos alegramos muchísimo que confiaras en nosotros para tu preparación. y como bien dices María, esta muy implicada con vosotros y disfruta con su trabajo, lo demuestra en cada una de sus clases; lo suyo es vocacional y con muchísimas ganas de ayudaros en todo para que consigáis vuestra plaza. Así que a estudiar a tope. '),(62,62,157,'Muchísimas gracias por tus palabras, la mejor parte de poder entrenaros es disfrutar de vuestros logros. Siempre y sin dudas ante cualquiera necesidad la tratáramos de atender lo antes posible, un abrazo '),(63,63,158,'Muchas gracias por confiar en nosotros, vamooooos a por esos objetivos, un abrazo'),(64,64,159,'Muchísimas gracias por tus palabras, siempre intentando mejorar y atenderos en todo.'),(65,65,160,'Muchísimas gracias, un placer ayudarte en lo que necesites. Vamoooossss'),(66,66,161,'Muchísimas gracias, nuestro mayor deseo es  que estéis lo mejor posible a la vez que cumplimos vuestras expectatívas.'),(67,67,162,'Muchísimas gracias por tu mensaje, siempre intentamos solucionar todas vuestras dudas y conseguir los objetivos marcados ?️‍♂️'),(68,68,163,'Muchísimas gracias Dani, un placer ayudaros a conseguir vuestros objetivos'),(69,69,164,'Muchísimas gracias por tu reseña, un placer ayudaros a lograr vuestros objetivos'),(70,70,165,'Muchas gracias, esperamos verte pronto por aquí!'),(71,71,166,'Muchas gracias por tus palabras :) Nos alegra saber que todo el esfuerzo que realizamos tiene sus resultados. Esperamos que te sientas parte de nosotros y que sigas entrenando con toda tu pasión. :)'),(72,72,167,'Muchas gracias, esperamos verte pronto por aquí!'),(73,73,154,'Muchas gracias, esperamos verte pronto por aquí!'),(74,74,155,'Muchísimas gracias por tu reseña !!! Nos encanta que formes parte de nuestra pequeña gran familia ?'),(75,75,156,'Muchísimas gracias por tu reseña!! Estamos encantados de que te guste tanto ???'),(76,76,157,'?????? muchísimas gracias por tus palabras ??? quizás has dicho las pal