entes como tú,gracias por confiar en nuestro trabajo y buen hacer. Un saludo!'),(276,276,161,'Se le a brindado una solución para arreglar su parquet y usted no a querido.el contrato que firmó usted decía claramente que lo defectos de obra que se produzcan después de la finalización de la obra correrían a cuenta de la empresa. Y usted no a querido que se le reparé.usted quería que la reparación se la realizará el carpintero que le puso a usted las puertas y lo abonaremos nosotros puesto que nuestro carpintero ya realizó las reparaciones oportunas y certificó la mala calidad de los materiales que usted compró y que se le advertio en reiteradas ocasiones. Y me parece de muy poca ética que su mujer ponga otra reseña contando mentiras sin sentido para intentar hacer daño. Tenemos una una dilatada experiencia en la reforma y la construcción,nos avalan más de 30 años en el sector,con una amplia cartera de clientes que demuestran en las reseñas que no somos como tú y tu mujer nos describí, tenemos agenda cerrada para un año de trabajo. No seremos tan malos! Un saludo y aquí nos tienes para lo que necesites.'),(277,277,162,'Ha sido un placer llevar a cabo vuestro proyecto y poder solucionar entre todos los inconvenientes que fueron surgiendo. '),(278,278,163,'Muchas gracias por la reseña y las fotografías. Ya sabes que estamos aquí para lo que necesitéis'),(279,279,164,'Ha sido un placer llevar a cabo vuestro proyecto, no a sido fácil pero se ha conseguido.'),(280,280,165,'Muchísimas gracias por la valoración. Ha sido un placer hacer vuestro proyecto.'),(281,281,166,'Muchas gracias '),(282,282,167,'Muchas gracias. Nos alegra que hayáis quedado contentos con el resultado de nuestro trabajo. Saludos. '),(283,283,154,'Muchas gracias'),(284,284,155,'Muchas gracias'),(285,285,156,'Muchas gracias. Somos conscientes de que hay detalles que pueden escaparse y no se detectan hasta que empiezas a vivir la reforma, por eso agradecemos a los clientes como tú, que nos loss digáis, para poder resolverlo y dejar todo perfecto. Te agradecemos la confianza depositada. Un cordial saludo'),(286,286,157,'Gracias .Estaremos encantados de poder ayudarte, siempre que lo necesites. Disfruta de un feliz día.'),(287,287,158,'Muchas gracias. Estamos encantados de poder trabajar con clientes que confían en nosotros. Entendemos que parte de nuestro trabajo es asesoraros en cuestiones técnicas. Siempre buscamos la forma optima de resolver los retos que los clientes nos planteáis. Disfruta de una feliz tarde.'),(288,288,159,'Buenos días, hago todo esos trabajos simplemente lo contrataste con otra empresa , el techo hubo un mal entendido y se rectificó a su gusto es decir quedó como usted lo quiso ya que me hizo demoler todo el trabajo realizado y hacerlo de nuevo como usted quiso, lo llame varias veces y nunca mas atendió el teléfono algo extraño para un cliente insatisfecho .'),(289,289,160,'Muchísimas gracias, pues aún con dificultades a lo largo del proceso y con vuestra paciencia y buena actitud, finalmente hemos conseguido un resultado magnífico :-) Os emplazamos para la siguiente :-)'),(290,290,161,'Muchas gracias por tu reseña. Nos encantó trabajar en vuestra reforma.La verdad que el cambio ha sido brutal ;-) Disculpas por la tardanza del suelo, pero como ya os comentamos en su día, fue debido al suministro de material y la política de empresa de la proveedora. Muchas gracias por tu reseña :-).Ya sabéis donde encontrarnos para la próxima.'),(291,291,162,'Muchas gracias :-) Fue un placer trabajar en vuestro domicilio y junto a vosotros que sois encantadores!! Siempre a vuestra disposición para lo que necesitéis!!'),(292,292,163,'Muchas gracias. Reseñas como la tuya nos animan a seguir trabajando en esa línea. Vuestra reforma aunque pequeña pero fue muy interesante por la complejidad de los pilares :-) Quedamos a vuestra dispo para lo que necesitéis :-) Saludos'),(293,293,164,'Muchas gracias por confiar con nosotros, ha sido un gran trabajo. '),(294,294,165,'La aceptación del presupuesto implica el pago por adelantado del 50% y de esa forma se establecen a posteriori la fecha de inicio para ejecución de su proyecto, si no se establecen formalmente estos parámetros la obra no se puede iniciar.'),(295,295,166,'Muchas gracias por conocernos tan bien, el barrio es el mejor boca a boca, y Ud. es nuestra mejor embajadora. Un abrazo.'),(296,296,167,'Estimada tu satisfacción es fruto del trabajo serio y consecuente como responsables del buen hacer diario y las calidades en general de los materiales, y un personal muy cualificado que da respuesta a sus necesidades.'),(297,297,154,'Gracias por su reseña, la próxima reforma su nueva casa, un saludo.'),(298,298,155,'Le agradecemos su reseña, seguimos en contacto para futuras reformas, un saludo.'),(299,299,156,'La verdad que le quedó un cuarto de baño muy elegante e iluminado, un placer haber trabajado en ese proyecto, un abrazo.'),(300,300,157,'Nos alegramos de haber dejado tu nueva cocina tan bonita, es que esos azulejos son de una calidad excepcional, gracias por contar con nosotros, un saludo.'),(301,301,158,'Estimada clienta tu satisfacción es fruto del trabajo serio y consecuente como responsables del buen hacer diario y las calidades en general de los materiales, y un personal muy cualificado que da respuesta a sus necesidades.'),(302,302,159,'Ha quedado una oficina de lujo, nos alegra que haya quedado satisfecho, muchísimas gracias y suerte en su nuevo negocio. Un saludo.'),(303,303,160,'Gracias por su reseña, la próxima reforma su nueva casa, un saludo.'),(304,304,161,'La fecha de inicio implica el ingreso/pago efectivo del 50% para poner en marcha el proyecto, y los plazos de ejecución se establecen en un rango de fechas para su inicio, si no se dan esas condiciones no se puede empezar a trabajar por nuestra parte.'),(305,305,162,'Buenas tardes en tu caso tramitamos la licencia de Apertura para tu centro de yoga en Teatinos y desde nuestro equipo queremos agradecer esta valoración tan positiva, nos alegra saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(306,306,163,'Buenas tardes. Desde el equipo te queremos agradecer este comentario tan positivo. Hicimos todo lo posible para que incluso en día festivo tuvieras la documentación y no tener que anular la firma en notaría. Y nos alegra saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(307,307,164,'Buenas tardes. Para nosotros y para todo el Equipo de B Edificación ha sido un placer realizar vuestro proyecto de nueva implantación de academia de Español aquí en la ciudad de Málaga. Con nombre Ail Málaga y página web https://www.ailmalaga.com/es/ donde podéis ver todos sus servicios y sus nuevas instalaciones en una estupenda ubicacion. Estaremos encantados de que puedas contar con nosotros de nuevo para vuestros futuros proyectos. Estas palabras nos motivan y nos empujan a seguir trabajando para que todos nuestros clientes queden contentos. Gracias!!!! '),(308,308,165,'¡Hola! Desde el equipo te queremos agradecer este comentario positivo, y en tu caso nos encanta saber que clientes como vosotros acabáis tan satisfechos después de realizar nuestro trabajo. Es una alegría saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(309,309,166,'¡Hola! Desde el equipo de BEDIFICACIÓN queremos agradecer este pedazo de comentario tan positivo. Es una alegría saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(310,310,154,'¡Hola! Desde el equipo de BEDIFICACIÓN queremos agradecer este comentario tan positivo. Es una alegría saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(311,311,155,'¡Hola! Desde el equipo de BEDIFICACIÓN queremos agradecer este pedazo de comentario tan positivo. Es una alegría saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(312,312,156,'¡Hola! Desde el equipo de BEDIFICACIÓN queremos agradecer este gran comentario tan positivo. Es una alegría saber que la experiencia con el servicio prestado ha sido satisfactoria y eso nos motiva para seguir trabajando con tanto empeño. ¡Seguimos en contacto para lo que necesites!. Gracias'),(313,313,157,'Hola, agrademos mucho sus palabras, nos alegra saber que ha tenido una buena experiencia.'),(314,314,158,'Muchas gracias, nos alegra que le agraden nuestros servicios.'),(315,315,159,'Muchas gracias por la valoración. Reseñas como la tuya nos dan mucha alegría. Gracias por la confianza.'),(316,316,160,'Muchas gracias por su reseña. ¡Un cordial saludo!'),(317,317,161,'Gracias por tus palabras y reconocimiento y enhorabuena por el éxito conseguido! '),(318,318,162,'Muchas gracias y enhorabuena por los éxitos conseguidos y poder hacer justicia! '),(319,319,163,'Muchísimas gracias! Estamos a su disposición.'),(320,320,164,'Muchas gracias. Estamos a su entera disposición. '),(321,321,165,'Gracias por su confianza en nuestro equipo. '),(322,322,166,'Muchísimas gracias, estamos siempre a su disposición.'),(323,323,167,'gracias Pol  por tu comentario, para nuestro equipo tambien es un placer trabajar con clientes como tu'),(324,324,154,'Muchísimas gracias, estamos a su disposición.'),(325,325,155,'Muchas gracias. Estamos a su entera disposición. '),(326,326,156,'Gracias por su confianza en nuestro equipo. '),(327,