INSERT INTO `users` VALUES (14,'NUEVA MENTE PSICOLOGOS','info@nuevamentepsicologos.com','951325269','nuevamentepsicologos.com','Gabinete Psicológico','81dc9bdb52d04dc20036dbd8313ed055','2023-05-31 12:15:58',1),(15,'FRANCISCO JOSE DEL RIO VELARDE','f.delrio.velarde@gmail.com','625376988',NULL,'ADMINISTRADOR','f813c705499c56d8cbce9349879dc048','2023-06-07 19:50:00',1),(17,'PsicoAbreu','info@psicologos-malaga.com','672404040','psicologos-malaga.com','En PsicoAbreu ofrecemos un servicio de atención psicológica de Calidad, guiado por los mejores psicólogos en Málaga especializados en Psicología Clínica y altamente cualificados que, mediante una terapia psicológica integradora eficaz, ayudan a resolver todas aquellas cuestiones Psicológicas que te afectan.','ea91daca3517315d59181f9b4823414b','2023-06-21 12:39:19',1),(18,'Zentra2','info@zentrados.com','951985638','zentra2.com','Zentra2 Psicología inició su recorrido en 2013. Ubicado en el centro de Málaga ha ido desarrollando su actividad en diferentes áreas profesionales dentro del campo de la psicología.\nEn sus inicios nos centramos en la Psicología Clínica atendiendo a niños, adolescentes y adultos','ea91daca3517315d59181f9b4823414b','2023-06-21 12:45:10',1),(19,'Mas Vida Psicologos','info@mas-vida-psicologos-malaga.com','675115042','mas-vida-psicologos-malaga.com','En Más Vida Psicólogos Málaga estamos encantados de ofrecerte nuestra experiencia y toda la ayuda psicológica que precises. Disponemos de tratamientos novedosos y muy eficaces en el campo de la psicología clínica, cognitiva y social. Lo que sin duda te ayudará a superar cualquier situación emocional por la que estés atravesando.','ea91daca3517315d59181f9b4823414b','2023-06-21 12:58:10',1),(20,'Desiree Infante Psicologa','psicologadesireeinfante@gmail.com','600977310','psicologadesireeinfante.com','Psicólogos en Málaga especialistas en psicología Sanitaria y Neuropsicóloga. Disponemos de un gabinete de psicología equipado con la infraestructura y profesionales necesarios para abordar todo tipo de problemas psicológicos que pueda estar sufriendo. Pide cita con nuestro equipo de psicólogos para llevar a cabo un diagnóstico y tratamiento personalizado específico para su caso.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:02:29',1),(21,'Valpe Psicologos','valpepsicologos@gmail.com','656430111','psicologiamalagacentro.com','En Valpe Psicólogos queremos ayudarte a alcanzar tus objetivos personales con herramientas prácticas, provenientes de la psicología basada en la evidencia. Olvídate de los mitos en torno a “ir a terapia”: Vivirás una experiencia agradable dónde descubrirás mucho sobre tí.\nHemos trabajado con cientos de personas y entendemos las complejidades y las dificultades que las personas encuentran en la actualidad. Los últimos avances en psicología y nuestro trato cercano son los elementos clave que te ayudarán a encontrarte mejor.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:08:35',1),(22,'Gabinete de Psicologia Málaga Javier Alvarez','GABINETEDEPSICOLOGIAMALAGA@GMAIL.COM',' 618058800','GABINETEDEPSICOLOGIAMALAGA.COM','Como psicólogo en Málaga, para nosotros la palabra “cambio” es casi como un mantra en psicología, algo que intentamos transmitir en sesión a través de metáforas, dichos populares, esquemas, dibujos o lo que sea necesario. “No se puede sacar agua de un pozo seco”, “Si has realizado una acción 50 veces qué te hace pensar que si esta semana hacemos la 51 obtendremos resultados”…, y así varias por el estilo según el día y la persona con la que esté trabajando.\nPorque el cambio, es mejora, la mejora, calidad de vida y salud mental.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:14:36',1),(23,'Salutis Centro Psicólogos Málaga ','info@salutiscentro.com','600023300','https://www.psicologosmalagasalutiscentro.com','Los psicólogos Málaga de Salutis Centro plantean nuevas alternativas a los pensamientos y patrones de conducta, motivando al cambio para que las personas aprendan a potenciar lo mejor de sí mismas.\nAcudir a Salutis Centro Psicólogos Málaga, le proporcionará un espacio donde podrá exponer su problema o dificultad y aprender a solucionarlo, potenciando sus puntos fuertes y manejando las propias limitaciones.','ea91daca3517315d59181f9b4823414b','2023-06-21 13:19:01',1),(24,'Lola Escalante Estudio Dental','info@estudiodentalescalante.es','633587193','https://estudiodentalescalante.es','En LOLA ESCALANTE ESTUDIO DENTAL estamos especializados en odontología estética y podemos ayudarte a conseguir la sonrisa que siempre has deseado. Tu Clínica Dental en Málaga.\nEntendemos que las necesidades dentales de cada persona son únicas. Por eso en nuestra clínica, la Dra. Lola Escalante, Dentista en Málaga, ofrecemos una amplia gama de tratamientos dentales a nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-21 15:44:08',1),(25,'Grupo Dental Clinic','info@grupodentalclinic.com','601442813','https://www.grupodentalclinics.es/','Con la garantía de saber que detrás te esperan los mejores dentistas en Andalucía. Un equipo de odontólogos y cirujanos maxilofaciales de primer nivel, dirigido por la Doctora Hanane Maalaoui y el Doctor Ariel Bilbao Góngora. \nCon la garantía de acceder a unas instalaciones pensadas para tu confort y para ofrecerte un servicio odontológico de máxima calidad. Con materiales de alta gama y tecnología punta.','ea91daca3517315d59181f9b4823414b','2023-06-21 15:52:39',1),(26,'Naturadent','info@naturadent.com','952265185','https://naturadent.es','Somos una clínica que lucha por una odontología verdadera, sin mentiras, sin tratamientos que no necesitas, a precios competentes, con facilidades de pagos sin intereses, con odontólogos destacados dentro del gremio, con especialistas con masters. Con la mejor tecnología.','ea91daca3517315d59181f9b4823414b','2023-06-21 16:22:12',1),(27,'Crooke Laguna Dental Clinic','malaga@crooke.net','952229192','https://www.clinicadentalcrookelaguna.com','Bienvenido a Crooke & Laguna, la Clínica Dental donde le ayudaremos a obtener una sonrisa soñada y saludable.\nContamos con profesionales expertos con más de 20 años de experiencia, especializados en diferentes campos para que tu tratamiento sea 100% personalizado desde principio a fin.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:03:58',1),(28,'Gross Dentistas','info@grossdentistas.com',' 649965932','https://www.clinicadentalgrossdentistas.com','Nuestra clínica principal está ubicada en Málaga, cuenta con 350 metros cuadrados y está provista de tecnología de diagnóstico para tratamientos dentales de última generación.\nEn todas nuestras clínicas ofrecemos el mismo servicio de compromiso, calidad y profesionalidad en tratamientos dentales, urgencias y cirugías.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:09:24',1),(29,'B&B Dental','info@bybdental.com',' 722239076','https://bybdental.com','Sabemos que no es el mejor plan ir al dentista , pero es necesario, por eso tratamos que venir a nuestra clínica dental sea lo más agradable posible. Para ello ofrecemos un trato cercano y especial a cada paciente.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:16:39',1),(30,'Prodentis Clinicas Dentales','info@prodentis.es','952392070','https://prodentis.es','En nuestras diferentes clínicas dentales estará en las mejores manos, recibirá las técnicas diagnósticas y terapéuticas más avanzadas, y será tratado por un equipo de dentistas de primer nivel. Profesionales del primer nivel en el sector que llevan años de experiencia en su carrera profesional. ','ea91daca3517315d59181f9b4823414b','2023-06-21 18:23:41',1),(31,'Cuomax','info@cuomax.com','951550450','https://cuomax.com','CUOMAX está formado por especialistas de alto nivel reconocidos en sus especialidades de odontología y cirugía maxilo facial.\nNuestra clínica está equipada con la tecnología más innovadora para formar profesionales en las técnicas y tratamientos de última generación.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:29:30',1),(32,'Clinica Poyatos','info@clinicapoyatos.com','621216252','https://clinicapoyatos.com','Desde 1965 ofrecemos tratamientos de podología para patologías o lesiones tanto propias del pie, como a nivel del resto del aparato locomotor de nuestros pacientes.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:43:10',1),(33,'Escaño Clinica Podologica','podologiaescano@gmail.com','951107277','https://malagapodologica.com','Bienvenidos a Clínica Podológica Escaño, su clínica podólogica en Málaga.\nMás de ocho años pendientes de la salud podológica general de sus pies, tratando cualquier alteración en la piel o morfológica del pie, preocupándonos por un correcto desarrollo del pie infantil para que pisen seguros toda la vida que tienen por delante, tratando con especial cuidado los pies que han guiado toda una vida en la tercera edad.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:49:53',1),(34,'Clinica Podologica Medina','info@clinicapodologicamedina.com','952653813','https://www.clinicapodologicamedina.com','Clinica Podologica Medina inicia su actividad a principios de 2001.Con un objetivo fundamental, ofrecer a nuestros clientes una asistencia integral en el cuidado de los pies.','ea91daca3517315d59181f9b4823414b','2023-06-21 18:56:20',1),(35,'Podozone','info@podozone.es','673097665','https://www.podozone.es','En clínica Podozone estamos al día de las últimas técnicas en tratamientos para ofrecer al paciente lo más adecuado a cada caso de forma personalizada','ea91daca3517315d59181f9b4823414b','2023-06-21 19:13:02',1),(37,'Clinica del Pie ','info@podologiademalaga.com','952042247','http://podologiademalaga.com','En Clínica del Pie la Unión nos preocupamos por resolver cada una de las patologías que nos encontramos en nuestro día a día desde el inicio de la actividad en 2002. Para ello contamos con modernas instalaciones y diversa aparatología, así cómo un proceso contínuo de formación y estudio en los nuevos avances para solventar todo tipo de problemas que afecten a la salud de nuestros pies y una estrecha colaboración con otros profesionales acreditados en biomecánica deportiva, infantil y cirugía podológica.','ea91daca3517315d59181f9b4823414b','2023-06-21 19:42:21',1),(38,'Centro de Podologia Larios','rosa.navaslopez@gmail.com','952221123','https://www.centrodepodologialarios.com','Somos Podología Larios, un centro de podología que cuenta con más de 30 años de experiencia en la localidad de Málaga. Ofrecemos los mejores tratamientos de podología.','ea91daca3517315d59181f9b4823414b','2023-06-21 20:33:06',1),(39,'Podologia Semedi','info@podologiasemedi.com','952284316','https://podologiasemedi.com','Es muy probable que ya nos conozcas, ya que son muchísimas las personas que han depositado su confianza en nosotros para que nos ocupemos del cuidado y la salud de sus pies. Pero si no es así,  estaremos encantados de recibirte y atender tus necesidades con la profesionalidad que nos caracteriza.','ea91daca3517315d59181f9b4823414b','2023-06-21 20:39:43',1),(40,'Clinica Manzano','info@clinicamanzano.es','952616080','clinicamanzano.es','Nuestra misión es mejorar la salud y el bienestar de nuestros pacientes poniendo a su disposición las últimas técnicas y tratamientos en cada una de nuestras áreas.\nTrabajamos por y para nuestros pacientes ofreciendo un servicio de calidad, personalizado y adaptado a las necesidades de cada uno.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:09:50',1),(41,'Fisioterapia y Osteopatia Victor Lluch','info@fisiolluch.com','722643148','https://fisiolluch.com','Dando lo mejor de nosotros a nuestros pacientes desde el año 2009.\nOfrecemos a nuestros pacientes un servicio de calidad, personalizado y siempre con la mayor profesionalidad.','ea91daca3517315d59181f9b4823414b','2023-06-22 09:38:37',1),(42,'Hiris Centro de Fisioterapia Integral','info@hiris.es','608907362','https://www.hiris.es','En Hiris, disponemos de diferentes salas para llevar a cabo los tratamientos fisioterapéuticos. Además en nuestra clínica f