nsultores.com','952308715','https://www.jimenezconsultores.es','Proporcionar seguridad a nuestros clientes en las areas del asesoramiento integral a empresas y autónomos personas físicas, mediante la prestación de servicios de calidad con personal especializado y tecnología punta.','ea91daca3517315d59181f9b4823414b','2023-06-22 16:29:22',1),(87,'Analizza Asesoria de Empresas','info@analizza.es','952072009','https://www.analizza.es','¿Necesitas una asesoría de empresas que te ayude de manera eficaz para la realización de los trámites contables, fiscales, o laborales de tu negocio?\nLlevamos 15 años asesorando a empresas. Conocemos perfectamente cuáles son tus necesidades y cuál es la mejor manera de solucionarlas.','ea91daca3517315d59181f9b4823414b','2023-06-22 16:33:05',1),(88,'Fernandez & Fernandez Abogados','info@ffabogados.com',' 615459238','https://ffabogados.es','Con más de 30 años de experiencia en el ejercicio de la Abogacía, en Fernández & Fernández Abogados estamos especializados en las diversas áreas del derecho actual, con el fin de poder ofrecer a nuestros clientes el mejor asesoramiento y defensa.','ea91daca3517315d59181f9b4823414b','2023-06-22 16:46:25',1),(89,'Bocanegra Abogados','info@bocanegra-abogados.com','952362147','https://bocanegra-abogados.com','El éxito de nuestro despacho de abogados radica en el componente humano y en la dedicación al cliente. Esta labor profesional comienza desde la primera consulta. Contamos con un equipo de profesionales con dilatada experiencia.','ea91daca3517315d59181f9b4823414b','2023-06-22 16:56:18',1),(90,'Lex Veritas Abogados','info@lexveritasabogados','622690166','https://lexveritasabogados.es','Situada en el corazón de Málaga capital, Lex Veritas Abogados es una firma jurídica que, bajo el eslogan «Artesanos del Derecho», brinda servicios legales especializados desde 2015, con el objetivo de impulsar el crecimiento de personas y empresas de manera transparente, cercana y detallista.','ea91daca3517315d59181f9b4823414b','2023-06-22 17:02:02',1),(91,'Rojano Vera Abogados','info@rojanovera.com','633225855','https://rojanovera.com','Rojano Vera cuenta con una exitosa trayectoria profesional en la provincia de Málaga y Valle del Guadalhorce (Cártama). Somos un despacho multidisplinar especializados en accidentes e indemnizaciones, herencias y testamentos, divorcios, deudas y reclamaciones bancarias, además de derecho penal, derecho laboral, extranjería y violencia de género.','ea91daca3517315d59181f9b4823414b','2023-06-22 17:06:21',1),(92,'Triuve Abogados','contacto@triuveabogados.com','644830602','https://www.triuveabogados.com','‍Nos gusta definir nuestra firma como un grupo de personas que ayudan a otras personas; y es que en Triuve Abogados nuestra prioridad es el cliente. De esta forma, tomamos consciencia de cuáles son sus necesidades en cada momento para poder prestarle una asistencia jurídica eficaz, cercana, transparente y de confianza. ','ea91daca3517315d59181f9b4823414b','2023-06-22 17:10:27',1),(93,'Alvarez Ramos Abogados','contacto@alvarezramosabogados.com','952916002','https://www.alvarezramosabogados.com','Álvarez Ramos Abogados es un despacho de abogados en Málaga que desarrolla su actividad a lo largo de toda la provincia de Málaga y zonas colindantes. Trabajamos asuntos en la ciudad de Málaga y en poblaciones cercanas como Fuengirola, Marbella, Antequera o Alhaurín de la Torre, entre otras. También llevamos a cabo nuestros servicios en provincias y ciudades cercanas a Málaga, como lo son Granada, Córdoba, Cádiz o Sevilla.','ea91daca3517315d59181f9b4823414b','2023-06-22 17:13:33',1),(94,'Uniac Trafico Abogados','info@uniactrafico.es','606334946','https://www.uniactrafico.es','Nuestra Unidad de Asistencia, está focalizada en la defensa de los derechos e intereses de los accidentados en Málaga, frente a la actuación abusiva de las compañías de seguros.','ea91daca3517315d59181f9b4823414b','2023-06-22 17:19:11',1),(95,'GBA Abogados','gbaabogadosmalaga@gmail.com','663464146','https://www.gbaabogados.com','GBA ABOGADOS lleva ejerciendo en la provincia de Málaga desde hace más 30 años, con un grupo muy nutrido de profesionales que conforman el mencionado bufete, hecho que ha permitido ir diversificándose con la única finalidad de dar el mejor y más riguroso servicio a nuestros clientes.','ea91daca3517315d59181f9b4823414b','2023-06-22 17:23:46',1),(101,'Tu red educativa','turededucativa@gmail.com','653086302','http://www.turededucativa.com','\r\n En nuestra academia de Málaga realizamos una enseñanza personalizada, intentando siempre adaptarnos a nuestros alumnos.\r\nPonemos a disposición de nuestros alumnos y alumnas una amplia oferta formativa que dé salida a vuestras necesidades de formación.','ea91daca3517315d59181f9b4823414b','2023-06-23 12:20:47',1),(103,'Academia Avenida Andalucia','info@academiaavenidaandalucia.es','692926952','https://academia-malaga.es','En pleno centro de Málaga tienes la academia con los profesores que buscas. Clases luminosas, climatizadas y bien equipadas, donde nuestros profesores trabajan las dudas de los estudiantes de manera personalizada en grupos reducidos','ea91daca3517315d59181f9b4823414b','2023-06-23 12:47:46',1),(104,'Oxford Lenguage School','info@oxfordls.com',' 665740487','https://oxfordls.com','Oxford Language School es hoy en día la red de centros de idiomas con más academias en Bizkaia . Contamos con un amplio equipo de más de 120 profesores de nivel nativo y una organización que a día de hoy forma parte de la educación en idiomas para más de 5.000 alumnos.','ea91daca3517315d59181f9b4823414b','2023-06-23 12:53:37',1),(105,'Academia Nueva Malaga','academianuevamalaga@gmail.com','615685433','https://academianuevamalaga.es','Somos un centro de estudios fundado en 1997 con amplia experiencia en el sector educativo y una clara vocación de formación. Nuestro objetivo es conseguir que todos nuestros alumnos encuentren la motivación y curiosidad por aprender día a día. \r\nContamos con material propio elaborado a lo largo de los años que se le va suministrando al estudiante según sus necesidades.','ea91daca3517315d59181f9b4823414b','2023-06-23 12:59:20',1),(106,'Academia Fye','info@academiafye.es','667001868','http://www.academiafye.es','Este grupo surgió con la idea de dignificar la profesion de vigilante de seguridad, formando profesionales, fomentando la especializacion y la mejora de empleo. En nuestras aulas se han formado cientos de alumnos, que sin duda representan nuestro principal aval y el motivo por el cual nuestro equipo docente trabaja dia a dia.','ea91daca3517315d59181f9b4823414b','2023-06-23 13:09:46',1),(109,'Icarus Academia','icarusaca@gmail.com','644174291','https://www.icarusacademia.es','Nos embarcamos en esta aventura con una meta clara: compartir con nuestro futuro alumnado nuestra pasión por los idiomas. Todos los miembros del equipo de Icarus Academia habíamos trabajado previamente en el mundo de la enseñanza, y ahora tocaba unir fuerzas, experiencias e ideas para crear un nuevo proyecto con un sello personal.','ea91daca3517315d59181f9b4823414b','2023-06-23 15:41:13',1),(110,'Adestudios','info@adestudios.com','699674720','https://adestudios.com','Nuestra aventura comenzó en 2012, cuando nuestra directora, MªCarmen, decidió comenzar un proyecto en el que llevaba años trabajando: el de ayudar a estudiantes universitarios a través de una educación práctica y de calidad. ','ea91daca3517315d59181f9b4823414b','2023-06-23 15:47:56',1),(111,'Academia Omega','info@academiaomega.com','638445763','https://www.academia-omega.com','Porque desde 1987 nos caracteriza el rigor, la seriedad, la experiencia y el compromiso de todo el personal de nuestro centro. Te sentirás rodeado de profesionales que darán soluciones a las cuestiones que te vayan surgiendo. Y lo más importante: tus profesores te harán sentir seguro durante todo el curso.','ea91daca3517315d59181f9b4823414b','2023-06-23 15:54:24',1),(112,'SmartFit','info@smartfit.es','910184467','https://smartfit.es','Somos una empresa que nace en 2013 con una vocación muy marcada dentro del sector del fitness, utilizar la experiencia adquirida gestionando grandes proyectos deportivos por parte de un joven equipo de profesionales para crear instalaciones acordes a las nuevas preferencias y hábitos de los usuarios.','ea91daca3517315d59181f9b4823414b','2023-06-23 16:16:05',1),(113,'Distrito 290 Malaga','info@distrito290larios.com','649814188','https://distrito290malagalarios.com','Distrito 290 Málaga Larios es mucho más que un gimnasio. Somos una boutique de entrenamiento centrada en la salud de las personas donde disfrutarás de todas las comodidades para que entrenes a gusto.','ea91daca3517315d59181f9b4823414b','2023-06-23 16:28:32',1),(114,'Brooklyn Fitboxing','pacificomalaga@brooklynfitboxing.com','608265097','https://www.brooklynfitboxing.com','Una manera diferente de hacer deporte. Alternamos rounds de golpeo al saco al ritmo de la música con ejercicios funcionales.\r\nTrabajamos cardio y fuerza. La manera más eficaz de tonificar y perder grasa. ','ea91daca3517315d59181f9b4823414b','2023-06-23 16:38:59',1),(115,'Synergym','info@synergym.es','625334085','https://synergym.es','Fundada en Málaga en 2013, Synergym es uno de los principales operadores de gimnasios de España.\r\nActualmente, y en un periodo de tiempo récord, somos unas de las grandes cadenas de fitness a nivel nacional, y nuestra intención no es parar de crecer.\r\n','ea91daca3517315d59181f9b4823414b','2023-06-23 18:42:58',1),(116,'O2 Wellness Malaga','elperchel@o2cw.es','952363900','https://malaga.o2cw.es','\r\nEn nuestros centros encontrarás actividades dirigidas (centros oficiales Les Mills), group trainings y actividades en agua con las que estamos seguros encontrarás una actividad que se ajuste a tus gustos y/o necesidades.','ea91daca3517315d59181f9b4823414b','2023-06-23 18:56:11',1),(117,'NowFit Center','info@nowfitcenter.com','605748999','https://nowfitcenter.com','NowFIT nació en Málaga (España) el 29 de diciembre de 2016, bajo un nuevo concepto innovador en el cual unimos todas las características esenciales de los gimnasios de la vieja escuela, también llamados “gimnasios de barrio”, con las grandes superficies, también llamados “macrogimnasios” o “gimnasios franquicia”. ','ea91daca3517315d59181f9b4823414b','2023-06-23 19:05:06',1),(118,'Reebok Sport Center Malaga','info@reebokmalaga.com','952659004','https://reebokmalaga.com','Somos uno de los mejores gimnasios del Centro de Málaga, contamos con la última tecnología en equipamiento, máquinas con TV incorporado y Código QR, y los mejores servicios.Reebok Sport Center Málaga te ofrece una Sala de Fitness de más de 350 m2 con 17 puntos cardiovasculares, 16 máquinas de de musculación, 13 bancos de peso libre, 2 multipower, mancuerneros y gran variedad de barras y diversos materiales para complementar tu entrenamiento.','ea91daca3517315d59181f9b4823414b','2023-06-24 09:56:41',1),(119,'Training Time','info@gimnasiotrainingtime.com','744669955','https://gimnasiotrainingtime.com','Training Time es un gimnasio diferente creado y dirigido actualmente por dos jóvenes emprendedores cargados de ilusión con el objetivo principal de mejorar la calidad de vida de las personas mediante un trato cercano, profesional e individualizado.\r\n','ea91daca3517315d59181f9b4823414b','2023-06-24 10:01:54',1),(120,'Coleccion del Museo Ruso','info@colecciondelmuseoruso.com','687077118','https://www.coleccionmuseoruso.es','La visita virtual está creada en tres idiomas y permite realizar un viaje por todas las salas de la exposición, recibir información sobre cada pieza, admirar con detalle las obras maestras del artista y, además, ver obras que no se muestran habitualmente. Las audioguías en ruso, español e inglés ofrecen la posibilidad de conocer más a fondo las piezas más interesantes de la exposición.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:12:18',1),(121,'Cac Malaga','cacmalaga@cacmalaga.eu',' 952208500','https://cacmalaga.eu','En el Departamento Pedagógico del CAC Málaga afianza y evoluciona en su línea iniciada en cursos anteriores: ser un Departamento dinámico y abierto, adaptado a las necesidades del profesorado y a los diseños curriculares de los diferentes niveles educativos.\r\n\r\nEl Programa Educativo que hemos elaborado para el presente curso escolar, cubre todos los niveles de la Enseñanza, desde Educación Infantil, Primaria, Secundaria, Bachillerato y Ciclos Formativos, hasta niveles universitarios.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:25:53',1),(122,'Muacp Malaga','museoartespopulares@fundacionunicaja.com','  952217137','http://www.museoartespopulares.com','Decano de los museos privados de la ciudad de Málaga, el Museo Unicaja de Artes y Costumbres Populares encuentra sus antecedentes en los años sesenta, a la par de la inauguración del Museo de Bellas Artes (1961), concebido con dos secciones más: la arqueológica y la etnográfica.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:30:30',1),(123,'Museo Carmen Thyssen Malaga','info@carmenthyssenmalaga.org',' 952217511','https://carmenthyssenmalaga.org','La transparencia y la participación son elementos que impregnan la actividad del Museo Carmen Thyssen. Los ciudadanos exigen y merecen disponer de toda la información sobre la actividad del Museo, ya no solamente por el carácter público de éste, sino también para poder implicarse en todas las actividades artísticas y culturales que dinamizamos.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:36:33',1),(124,'Museo Revello de Toro','info@museorevellodetoro.net','952062069','https://www.museorevellodetoro.net','El Museo Revello de Toro está concebido como un espacio expositivo dotado de la más avanzada tecnología y que se propone cumplir tres objetivos. En primer lugar, su finalidad esencial es exponer permanentemente la cesión que el afamado retratista y pintor figurativo malagueño Félix Revello de Toro ha realizado a su ciudad natal. De las ciento cuarenta y dos obras se muestran al público ciento trece entre óleos, bocetos y dibujos que forman la colección permanente del Museo.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:42:33',1),(125,'Principia Centro de Ciencia','info@principia-malaga.com','952070481','https://www.principia-malaga.com','PRINCIPIA es un centro de ciencia interactivo que se caracteriza por favorecer la divulgación científica y tecnológica a todo el público de forma amena, sin perder rigor en sus contenidos.\r\nEs interactivo porque existe una manipulación de los objetos que invita a pensar, reflexionar y experimentar, motivando al visitante a conocer e investigar por si mismo el fundamento científico de los fenómenos naturales del mundo que le rodea.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:49:48',1),(126,'Museo Casa Natal Picasso','museocasanatalpicasso@malaga.eu','951926060','https://museocasanatalpicasso.malaga.eu','Pablo Ruiz Picasso (Málaga, 1881-Mougins, 1973) es unánimemente considerado como uno de los artistas más importantes de la historia del arte, y posiblemente el más influyente del siglo XX.\r\nPintor, dibujante, grabador, escultor, ceramista, diseñador teatral, escritor… una figura emblemática del arte moderno que demuestra su perenne actualidad por el número de exposiciones, publicaciones, investigaciones y noticias que sigue generando.','ea91daca3517315d59181f9b4823414b','2023-06-24 10:55:02',1),(127,'Centro Pompidou Malaga','info.centrepompidou@malaga.eu','951926200','https://centrepompidou-malaga.eu','El departamento de mediación está constituido por expertos en historia del arte y bellas artes, casi todos con intereses en áreas transversales al mismo: historia cultural y social del arte, filosofía, antropología, sociología, práctica artística y otras expresiones del arte. Estos conocimientos dan gran diversidad a las visitas mediadas, haciendo de cada una de ellas una experiencia única.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:06:35',1),(128,'Adendia Inmobiliaria','ventas@adendia.com','639584294','https://adendia.com','En Adendia somos veteranos en el mundo de la gestión inmobiliaria.\r\nDesde 1982 hemos llevado a buen término proyectos que suman un total de más de 750.000 metros construidos y un valor de venta de más de 1.200 millones de euros.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:14:58',1),(129,'CitiCasa','info@citicasa.es','952336342','https://www.citicasa.es','MÁLAGA, NUESTRA PASIÓN\r\nCada año, sin excepción, aportamos nuestro granito de arena a la ciudad con la que amanecemos cada día.\r\nHabituales colaboraciones radiofónicas, televisivas, campañas de visibilidad en EMT y METRO, incluso con el equipo de fútbol de nuestra ciudad.\r\nEn CITICASA siempre estaremos por y para nuestra querida MÁLAGA.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:20:26',1),(130,'PlanetaCasa','huelin@planetacasa.net','697266609','https://www.planetacasa.net','Somos una empresa española fundada en 2009 tras la unión de empresarios y profesionales del sector inmobiliario y el sector financiero con más de 25 años de experiencia a sus espaldas.\r\nGrupo Planetacasa fue creado para dar solución a la crisis del sector inmobiliario nacional y como respuesta a la necesidad de los clientes que buscan comprar, vender o vivienda en Málaga, bajo un método de trabajo avalado por nuestra propia experiencia.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:27:56',1),(131,'RedPiso','info@redpiso.com',' 915078237','https://www.redpiso.es','La misión del Grupo REDPISO es atender las necesidades de los clientes en relación al sector de la intermediación inmobiliaria y financiera, que residen en las áreas donde nos encontramos y que quieren alquilar, adquirir o vender una vivienda en las mejores condiciones, con la mejor financiación posible y bajo un trabajo profesional y de calidad. Y por otro lado, ofrecer un gran número de oportunidades de desarrollo personal y profesional a sus franquiciados y a sus empleados, sea cual sea su edad, sexo o nacionalidad.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:36:01',1),(132,'Globbe International','info@globbe.com','952202413','https://www.globbe.com','Nuestro mayor líder en la empresa, es mi padre, D. Antonio M. Díaz Huettors, nos ha enseñado mucho durante este trayecto, tras muchas batallas día a día aprendemos cosas nuevas, por lo cual nos sentimos satisfecho de ello.\r\nSomos una pequeña empresa dedicada totalmente y volcada a todos nuestros clientes, ya sean compradores o vendedores.\r\nNos gusta sentarnos con ellos, que nos cuenten sus historias, sus alegrías, sus problemas y poder siempre ayudarles en todo lo posible. Nuestra transparencia es lo que nos destaca, nos gusta ver las cosas con perspectivas y con lógica.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:40:26',1),(133,'Inmobiliaria Alianza Propiedades','info@alianzapropiedades.com','952040357 ','https://www.alianzapropiedades.com','ALIANZA PROPIEDADES es una empresa joven, dinámica y ágil que se adapta a los exigentes cambios del mercado y la sociedad, manteniéndose siempre cerca del cliente.\r\nNuestra experiencia y amplia formación técnica garantizan la máxima eficacia en cualquier tipo de gestión inmobiliaria.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:44:48',1),(134,'Levy Inmobiliaria','info@levyinmobiliaria.es',' 691334447','https://www.levyinmobiliaria.es','Inmobiliaria LEVY es una agencia especializada en la gestión de alquiler y venta de activos inmobiliarios en Málaga y Provincia. Ésta se encuentra formada por un equipo humano multidisciplinar, compuesto por reconocidos profesionales en el sector. Nuestra amplia experiencia adquirida a lo largo de los años como agentes de la propiedad inmobiliaria, nos permite ofrecer un producto de excelencia y no solo para el cliente comprador sino también para nuestro cliente vendedor.','ea91daca3517315d59181f9b4823414b','2023-06-24 11:48:27',1),(135,'Casavida inmobiliaria','malaga@casavida.es','615665531','https://casavida.es','Casavida Inmobiliaria es uno de los proyectos más importantes de Grupo Presente Inversiones.\r\nCuenta con equipos formados por verdaderos profesionales especializados en la consultoría sobre compraventas y arrendamientos de inmuebles residenciales.','ea91daca3517315d59181f9b4823414b','2023-06-24 12:00:21',1),(136,'Audio Factory','info@audiofactory.com',' 608683935','https://www.audiofactory.es','Tienda de Alta Fidelidad y Cine en Casa en Málaga. Expertos en equipos de alta fidelidad y home cinema. Te asesoramos en Málaga para que encuentres tu equipo bajo marcas reconocidas del sector AV.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:08:44',1),(137,'BaseDj','rogemusic@hotmail.com','699877549','https://www.basedj.es','Tienda de sonido Malaga, Tienda dj Malaga,Componentes Electronicos,Repuestos De Altavoces\r\nVenta de equipos de sonido e iluminacion, Etapas de potencia, Microfonos, Auriculares, Maquinas de humo, Laser RGB, Efectos Led, Reproductor de CD, Laser multipuntos, Monitores de Estudio, Megafonia para coches, Amplificadores de sonido, Repuestos de Altavoces, Giradiscos, Soportes y accesorios dj, controladores midi, Flash Strobo, Racks.\r\n\r\n','ea91daca3517315d59181f9b4823414b','2023-06-25 10:14:50',1),(138,'JC Valvular','jcvalvular@gmail.com','659153768','https://jcvalvular.com','Somos una empresa afincada en Málaga capital dedicada al sonido en general. En nuestras instalaciones contamos con zonas de reparación de toda la gama de sonido y zona dedicada a la fabricación, todos los productos están realizados de forma totalmente artesanal.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:19:55',1),(139,'Mas Life','info@maslifeunion.com','622286972','https://maslife.es','¡Somos la tienda que reúne todas las marcas\r\ndel grupo MASMOVIL en un mismo lugar! En nuestra\r\ntienda encontrarás tarifas de todos los colores\r\ncon asesoramiento personalizado','ea91daca3517315d59181f9b4823414b','2023-06-25 10:29:32',1),(140,'Movil Planet','contacto@movilplanet.eu','651050019','https://movilplanet.eu/es','Movil Planet nace como tienda online desde Málaga en 2016 gracias al esfuerzo de poner a tu alcance la mejor selección de accesorios para móvil y realidad virtual a precio mínimo, dedicándonos a la venta e importación de este tipo de productos.\r\nEn 2017 empezamos a comercializar teléfonos móviles al mejor precio desde España centrando en ello nuestro modelo de negocio. Nuestra filosofía es la de trabajar sólo con proveedores de confianza que nos permitan ofrecer los mejores precios a nuestros Clientes sin renunciar a la calidad ni garantía de todos nuestros productos, apostando por un trato cercano y una atención personalizada según tus necesidades.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:36:41',1),(141,'Cosladafon','info@colasdafon.com','633854713','https://www.cosladafon.com/','Cosladafón nace con la necesidad de querer ofrecer a todos los amantes de la tecnología el mejor catálogo de productos a un precio super competitivo. Apostamos por desarrollar un servicio de venta de telefonía a través de nuestra tienda online. Nuestro objetivo ha sido y es el de ofrecer el precio más competitivo del mercado, dar un servicio de rapidez (nuestra tienda funciona 24/7) y todo ello sin renunciar a la calidad y un buen servicio de postventa.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:47:45',1),(142,'Tienda Vodafone','info@tiendavodafonemalaga.com','621228229','https://tiendas.vodafone.es','Solicita cita previa en tu tienda donde resolveremos tus dudas y te asesoraremos sobre las soluciones de red para negocios y hogar. Fibra de alta velocidad, la mejor cobertura 5G o nuestras tarifas ilimitadas.','ea91daca3517315d59181f9b4823414b','2023-06-25 10:52:54',1),(143,'Muy Nuevo','info@muynuevo.com','952617004','https://muynuevo.com','Muynuevo.com nació hace 3 años como una tienda de móviles Km.0 procedentes de exposición y escaparates, revisados y certificados por nuestro equipo técnico, estos productos son los catalogados como muynuevo.','ea91daca3517315d59181f9b4823414b','2023-06-25 11:00:12',1),(144,'Tecno Malaka','info@tecnomalaka.com','627867618','http://www.tecnomalaka.com','Realizamos reparaciones de equipos informáticos y de telefonía móvil , Instalaciones de Alarmas y Equipos de Videovigilancia, Mantenimiento a Empresas, Instalacion de Antenas y Sistemas de iluminación Led. Disponemos de Servicio a Domicilio. Además en nuestra tienda suministramos equipos y componentes con la mejor calidad del mercado y ofrecemos servicio de revelado de fotos y fotografías de carnet.','ea91daca3517315d59181f9b4823414b','2023-06-25 11:04:50',1),(145,'Movitel Shop','atencion.cliente@movitelshop.com','635360428','https://movitelshop.com','Movitelshop.com es una tienda online con tienda física En Málaga Capital.\r\nEmpresa Joven fundada en el 2016 con personal que tiene más de 12 años de experiencia en el sector de la telefonía e informática.\r\nDisponemos de las últimas novedades en telefonía y accesorios al mejor precio.\r\nRealizamos envíos a toda España y Portugal peninsular, ofreciendo un servicio postventa inmejorable.','ea91daca3517315d59181f9b4823414b','2023-06-25 11:09:29',1),(146,'Medic Phone','ventas.medicphone@gmail.com','643124399','https://medicphone.es','Desde nuestros inicios, nos hemos comprometido a brindar un servicio de alta calidad y confiable. Nuestro equipo de expertos en reparación cuenta con años de experiencia y está altamente capacitado en las últimas técnicas y herramientas de reparación. Nos enorgullece poder ofrecer reparaciones precisas, eficientes y rápida, asegurando que su dispositivo funcione como nuevo.','ea91daca3517315d59181f9b4823414b','2023-06-25 11:14:23',1),(153,'cole','cole@cole.com','938475912','cole.com','cole','5427e86322c317fa478145c7385f5ae6','2023-06-29 18:01:48',1),(154,'Ana Rosa Mesa Campos','anarosames@gmail.com','652477185',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:46:12',1),(155,'Pedro Javier Rodriguez Vargas','pejavier@gmail.com','636987575',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:49:12',1),(156,'Antonio Moreno Rojas','anmojas@gmail.com','722453692',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:50:12',1),(157,'Maria Aurora Romero Torres','aurori@gmail.com','645127563',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:51:12',1),(158,'Rosario Rosas Gutierrez','rosita@gmail.com','725456352',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:52:12',1),(159,'Francisco Sanchez Sanchez','fransans@gmail.com','623154747',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:52:12',1),(160,'Irene Gomez Garcia','irenegomezgarcia@gmail.com','741562320',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 09:57:12',1),(161,'Sonia Vergara Itziar','soniaver@gmail.com','695847122',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:00:45',1),(162,'Ignacio Fuentes Vazquez','nachofuentes@gmail.com','714369874',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:04:45',1),(163,'Mario Lopez Lopez','mariolo2@gmail.com','624150032',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:05:45',1),(164,'Eva Maria Garcia Hinojosa','evagarcia@gmail.com','636128763',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:08:45',1),(165,'Marina Peña Oliver','oliverpeñamarina@gmail.com','741258978',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:42:45',1),(166,'Alvaro Pimenton Garcia','alvarino@gmail.com','639512241',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:44:45',1),(167,'Sara Rodriguez Mezquita','sara@gmail.com','699157480',NULL,NULL,'ea91daca3517315d59181f9b4823414b','2023-06-30 10:50:45',1);
