INSERT INTO `valoraciones` VALUES (1,14,5,'Me sentí muy cómodo, la profesional ya había trabajado con pacientes con enfermedad inflamatoria intestinal y eso me hizo sentirme comprendido. Agradezco mucho su labor, me ayudó a gestionar los problemas que se derivan de mi enfermedad como la ansiedad. Muchas gracias.',15),(2,14,4,'Fantástico una sola sesión, me ha servido, de momento para saber más de mismo, eso es muy difícil de conseguir',15),(3,14,3,'El gabinete es muy acogedor y relajante y, el trato personal es inmejorable. Muy profesionales de la psicología de varios que probé el que más me han tocado de los que he conocido en los últimos 11 años. Eficacia, preparación y versatilidad. Muy recomendables!!',15),(4,14,1,'La atención de María José ha sido estupenda. Estaba cansada de vivir constantemente con ansiedad y tras mucho tiempo decidí ir a terapia. La mejor decisión que pude haber tomado. Muchas gracias',15),(5,17,5,'Me ha encantado el trato y la amabilidad de Isaac, se implica profesional y personalmente, lo que lo hace muy grande. Millones de gracias por todo. Ha sido un placer contactar con ustedes. Un saludo.',164),(6,17,3,'Rodolfo primero y después Maribel, os debo la vida jaja sois lo mejor del mundo. Empatía, solidaridad, humildad , que más puedo decir después de tantos años. Las mejores personas que he conocido',154),(7,17,4,'El Dr. Isaac es un gran profesional, me está ayudando muchísimo. Siempre que salgo de su consulta salgo con otra energía mucho más renovada. Me siento acompañada y tranquila en mi proceso.',155),(8,17,5,'Trato cercano, amigable e incluso familiar. A pesar del poco tiempo de contacto a distancia con el psicólogo Isaac, todo está fluyendo fantásticamente. Agradecer todo lo que está haciendo por mí, ojalá todos sean así.',156),(9,18,3,'La verdad es que voy  con un gran profesional, con mucha experiencia. La terapia me está salvando y me ha permitido recuperar mi paz interior.',157),(10,18,5,'En mi primera vez que necesité encontrar a un psicólogo tuve la suerte de encontrar a un gran profesional llamado Isaac Quirós, lo recomiendo 100%.',158),(11,18,5,'Atención personalizada y muy buena, no puedo estar mas agradecida',159),(12,18,4,'Excelente atención,  ambiente adecuado y personal cualificado.  Realmente sientes que están dispuestos ayudar.',160),(13,19,4,'Son todos unos grandes profesionales, me ayudo de la mejor forma y justo como lo necesitaba aún sin yo saberlo. Además tienen gran disponibilidad horaria.',161),(14,19,5,'Mi experiencia fue muy buena incluso lleve a mi hija a consulta ',162),(15,19,5,'Mi experiencia,  ha sido excelente, desde el primer día que acudí a ellos, los recomendaría una y mil veces, el trato es maravillo, y la profesionalidad excelente.',163),(16,19,3,'El local está localizado en pleno centro de Málaga. Son grandes profesionales. Después de muchos psicólogos han conseguido dar en la tecla perfecta. Son grandes profesional con gran capacidad de escucha al paciente y muy empaticos. Ha sido genial poder haber encontrado a estos grandes psicólogos y que por fin haya recibido la ayuda que tanto tiempo llevaba buscando. ',165),(17,20,5,'Muy buena consulta.Me está ayudando mucho a comprenderme mejor.',166),(18,20,5,'En un momento difícil de mi vida acudí a este gabinete en busca de ayuda y allí he encontrado a la persona que me ha enseñado a gestionar mi situación.',154),(19,20,3,'Empecé yendo a terapia hace seis meses al tener problemas de ansiedad y gracias a ellos he aprendido un montón de herramientas y conceptos para aprender gestionarla y que así deje de ser un impedimento en mi vida. Al empezar no me imaginaba hasta que punto toda la ayuda me ha transformado en todos los aspectos de mi vida, proporcionándome la capacidad de replantearme siempre la perspectiva que adopto en las situaciones y frente a los problemas. Totalmente recomendable y muchas gracias por vuestra labor,',155),(20,20,4,'Mi psicólogo es una persona encantadora, ofrece un trato y una profesionalidad de 10!!',156),(21,21,3,'Eficaz. He obtenido las herramientas que necesito para avanzar y conocerme mucho mejor Le estoy totalmente agradecido. Para mejorar: Instalar un datáfono. Esa opción de pago es fundamental para generar confianza en cualquier empresa.',157),(22,21,4,'Su profesionalidad fue genial. Su trato y su ayuda me ayudaron a superar una etapa bastante complicada de mi vida. Muchas gracias!',158),(23,21,5,'Buenos días',159),(24,21,3,'Llevaba años queriendo dar terapia pero nunca encontraba el momento para ir ,hoy digo que es lo mejor que he podido hacer ,dar el paso de ir y pedir ayuda ,pienso que todos la necesitamos alguna vez en la vida .',160),(25,22,5,'He recibido un trato amable y empático. Me he sentido muy a gusto en las sesiones, escuchada, valorada y comprendida. Ha sido un proceso que me ha permitido aprender infinidad de cosas, las cuales puedo seguir aplicando en mi vida diaria.',161),(26,22,4,'Gracias por su profesionalidad, estoy consiguiendo resultados muy positivos con cada sesión. Cercano, humano y comprometido con los objetivos a conseguir. Recomendado al 100%. Muchas gracias por tu ayuda!',162),(27,22,5,'Gran atención, buenos profesionales. A mi familia le ha venido estupendamente.',163),(28,22,4,'He de decir que aún me queda un largo camino por recorrer ya que llevo tan sólo dos sesiones, pero en mi caso salgo de la consulta con alivio y con ganas de mejorar gracias a las pautas que te dan. Desde el primer día te hace sentir cómodo y libre para contar abiertamente tu(s) problema(s). Espero que esta sensación perdure y me haga llegar a la cima.',164),(29,23,1,'Bastante decepcionada después de 7 meses asistiendo, sin ver cambios a mejor, no había avances ni muchos ejercicios, las sesiones me empezaron a resultar demasiado repetitivas sin llegar a ver los puntos en los que yo podía fallar y/o mejorar.',165),(30,101,5,'Tengo que felicitar a la academia y al grupo de profesionales que hacen una magnífica labor día a día. En especial a la profesora de inglés que ha trabajado con entusiasmo para mi aprobado. Un sitio muy recomendable.',167),(31,101,4,'Me apunté a un intensivo, porque necesitaba sacarme el inglés sí o sí. Además, facilitan plataforma y materiales por WhatsApp y en el aula. En dos meses iba más que preparada y conseguí la C que era mi objetivo desde el principio. Gracias nuestra profe que con tanto cariño nos ha enseñado lo necesario para adaptarnos a este examen y a la administración por ponerlo todo tan fácil. Hemos trabajado en un grupo reducido y ha sido una experiencia súper satisfactoria. ¡Gracias chicos!',154),(32,101,5,'En septiembre del 2020 decidí opositar para policía local y empecé a mirar academias en google maps y reseñas sobre las mismas. Es ahí cuando encontré esta academia y decidí adentrarme con ellos en este duro proceso que ha acabado hace unos días. Una academia con auténticos profesionales como Juan y Manolo que te asesoran y te guían en tu camino, pero que el resto del nivel para conseguir plaza lo pone tu constancia, sacrificio y las ganas. Gracias a ellos conseguí mi objetivo de ser policía y en un sitio tan especial como Nerja. Eternamente agradecido de haber compartido tan buenos momentos con vosotros y estoy seguro que no lo hubiera alcanzado sin vuestra ayuda. Aquí teneis a un alumno y amigo para toda la vida. Asi que si estas pensando en escoger esta academia, ni te lo pienses y ve con ellos a por todas... te informaran de todo y te ofreceran una formación inmejorable. ¡¡Recomendable al 200%!!',155),(33,101,4,'La mejor y más profesional academia que he encontrado, tras muuuuuuucho buscar y comparar. Cabe hacer mención especial a la estupenda, loquilla, vibrante y brillante Alicia!! Quién con mucha paciencia me ha ayudado a saber que rumbo de oposiciones coger más adecuado a mi situación personal. Gracias por tu empatía constante! También al pedazo de Miguel, quien tiene años de experiencia desde dentro del SAS, lo que hace que con su temario hayan aprobado desde auxiliar hasta TMFA. A por ello!?????? TOTALMENTE RECOMENDABLE!!!!',156),(34,103,1,'Me habeis hecho perder 100 euros! Que clase de academia te cobra una mensualidad la cual no asistes ni un día del mes por causas mayores( avisando yo previamente que no iba a asistir) ya veo el interés que tenéis por vuestros alumnos. La organización es decepcionante te venden que son 4 horas en las cuales vas a dar todas las partes del APTIS y es totalmente mentira, en dos meses que he estado he visto 2 veces mal contadas temas como el speaking o writing. No perdáis vuestro tiempo y sobre todo vuestro dinero , buscad otra academia que seguro que os ayuda mas que esta',157),(35,103,5,'Hoy ha salido la nota de corte y lo he conseguido, estoy dentro! Funcionario de prisiones! Estoy muy agradecido a esta academia, son un equipo fantástico de profesionales, desde la recepción, hasta la preparadora. He estado antes en otras y sin duda en esta son los mejores preparando la opo. El trato familiar, la confianza, el asesoramiento, las facilidades para asistir tanto presencial como online, la plataforma, el material, test supuestos y un largo etcétera. La recomiendo 100x100. Gracias Alicia por cambiarme la vida, este es el mejor regalo de Navidad que podía tener :)',158),(36,103,4,'Recomiendo esta academia al 200%. Es la primera vez que me preparo y me presento y he conseguido plaza!!! No hubiera sido posible sin la amabilidad, profesionalidad y cercanía de Alicia y Luis que siempre te dan una palabra de ánimo y una sonrisa y te hacen algo más fácil lo difícil que es esto de opositar. Y por supuesto Miguel, que es un preparador de 10, conoce perfectamente el temario y te da la tranquilidad de que siempre está atento a todas las actualizaciones del mismo. Sus temas son precisos y completos, sus test impresionantes, no se deja nada atrás. Yo estoy súper contenta no solo de haber conseguido mi plaza sino de haber tenido la oportunidad de conocer a personas tan maravillosas como ellos. Enhorabuena por la academia y sobre todo por vuestro trabajo!!!',159),(37,103,4,'Durante el pasado curso me apunte en esta academia para aprender y poder presentarme al titulo de B1 de inglés y no puedo estar más contenta. En mi caso estuve con Elle un amor de persona, que siempre se preocupaba por que tuviésemos todo el material que necesitábamos y nos fuéramos a casa sin ninguna duda. Además, Alicia la dueña te recibían siempre tan simpática y alegre, algo que se agradece después de tener un día duro. Sin duda alguna volvería a repetir :)',160),(38,104,5,'Este año decidí presentarme por primera vez a las oposiciones y no puedo estar más contenta de haber elegido esta academia. Alicia es un amor que procura siempre animarnos y motivarnos, y resolver cualquier duda que tengamos.',161),(39,104,3,'Solo decir, que ha sido una gran experiencia y acierto elegir esta academia. No soy de escribir reseñas, pero creo que merecen un pequeño reconocimiento al buen trato y profesionalidad.',162),(40,104,4,'Mi aprendizaje en esta academia ha sido muy completo y muy asesorado por todo el equipo, en especial recomiendo a Jose, mi preparador de oposiciones de primaria. Los temas muy bien resumidos, una buena estrategia de enseñanza, un sistema muy eficiente en las clases. Recomiendo 100% la inscripción. Siento haber tenido que irme antes de tiempo por razones de peso, pero si tuviera que elegir prepararme para las oposiciones, de nuevo os elegiría a vosotros. Gracias por toda vuestro apoyo a nivel escolar.',163),(41,104,5,'Una Academia con profesores cualificados y una atención personalizada, y con un apoyo incondicional para el grupo.',164),(42,105,3,'Muy buena experiencia, academia muy bien formada y una atención tanto de secretaría como de profesores excelente. Yo estuve con Cynthia en el B2 de francés, una chica muy amable y entregada a si trabajo, un amor de persona en mi opinión. Si tuviera que seguir aprendiendo no dudaría en volver esta academia.',165),(43,105,5,'Para mí, sin duda, elegir esta academia fue la mejor decisión que tomé. Muy profesionales y cercanos al mismo tiempo. Son un equipo fenomenal y te asesoran y ayudan en todo lo que necesites.  Gracias a todos me enfrenté a unas oposiciones duras pero segura de que iba bien preparada. Les doy un diez',166),(44,105,4,'Nada más salir de la carrera me aconsejaron preparar mis primeras oposiciones en esta academia. El clima que se respira es muy bueno y me gustaría mencionar especialmente a Alicia y Luis, dos personas muy cercanas que han estado pendiente no sólo al material que nos hiciera falta, sino a nuestro proceso, crecimiento... lo que ha facilitado nuestro esfuerzo y paso por la academia. Por último, mi querida Lidia, preparadora de PT, es una pieza clave para el grupo de opositores y opositoras de PT, porque se ha dejado la piel con cada uno de nosotros, preocupándose a nivel profesional y personal y atendiéndonos en cualquier momento, ofreciendo explicaciones, materiales, tareas... ideales y consejos especiales. Es una magnífica profesora y persona.',167),(45,105,3,'Excelente academia. Me preparé las oposiciones Educación Primaria de este año con el preparador Jose y la verdad que no me arrepiento de nada!! Un trato espectacular. Aunque las oposiciones son un proceso bastante duro, te sientes muy arropado/a por todos ellos. Recibes una gran formación y, además, te sientes como en casa. Las clases no son numerosas, lo cual fue una de las cosas que también me gustó mucho ya que buscaba un sitio donde me ayudaran a personalizar tanto el temario como la programación didáctica. Además, te dan todo el material y si tienes cualquier tipo de problema, te ayudan a resolverlo hasta el final. Me gustaría agradecer a todo el equipo y, en especial, a Jose por ayudarme a conseguir mi objetivo; una nota bastante alta en mis primeras oposiciones. GRACIAS DE CORAZÓN!!',154),(46,106,5,'La mejor academia de Málaga, excelentes instalaciones, organización y gran equipo humano. Estudié oposiciones de Hacienda, imposible tener mejor profesora, gran material de calidad, muy buen método de enseñanza, además de una gran seriedad, compromiso y responsabilidad. Sin dudas, animo a probarla, siempre están a tu disposición y con su ayuda puedo decir hoy que soy agente de Hacienda Pública!',155),(47,106,4,'Sin duda la mejor elección que pude hacer a la hora de escoger un centro de formación. Profesionales, bien cualificados y muy atentos y pendientes al alumnado. Conseguí mi plaza a la primera oposición, gracias a todo el equipo que me ha ayudado. Gracias a  Alicia por su ánimo, a José por todo su empeño y por supuesto a María , una preparadora de 10. Estaré toda mi vida agradecido por vuestra ayuda y repetiría mi experiencia sin duda. Unos compañeros de clase excepcionales, un buen ambiente de trabajo,..... Sólo puedo decir palabras buenas.',156),(48,106,4,'Ha sido un curso maravilloso, atención cercana por parte de la academia y un trabajazo por parte de mi preparador Alex. Atento durante todo el curso y aportando muchas y buenas ayudas para conseguir el objetivo en las oposiciones. Por mi parte estoy encantado y lo recomiendo para todos aquellos que necesiten una academia y un buen preparador de oposiciones.',157),(49,106,5,'Aquí otro que ha conseguido la plaza de funcionario de prisiones con la ayuda de esta academia que son geniales tanto en el trato como con cualquier cosa que necesites y de la profesora Lorena que es la mejor opción si quieres sacarte tu plaza',158),(50,109,3,'Hace un año deje una reseña cuando empecé este largo viaje como opositora y una vez finalizado, merece la pena escribir otra.',159),(51,109,5,'Ha sido un placer pertenecer a esta academia durante la preparación de las oposiciones de PT.',160),(52,109,4,'Me preparé las oposciciones de Magisterio de E.F.. Ha sido la mejor academia en la me he preparado, el personal en general es muy amables, profesionales y simpáticos.',161),(53,109,4,'Mi experiencia con esta academia y especialmente con Laura Piccinini, la profesora de Italiano ha sido buenísima, gracias a ella he podido sacarme en verano un B2 de la EOI. Hice un curso intensivo online de julio y agosto y en septiembre aprobé la modalidad libre de la escuela oficial de idiomas, muy contenta con haberlo elegido, lo recomiendo 100% GRACIAS!',162),(54,110,5,'Academia 100% recomendable. Llevo ocho meses con ellos y son todos un encanto. Alicia y Luis, los dueños, están siempre dispuestos a ayudarte en todo. Son muy flexibles y cariñosos con los alumnos. Y que decir de mi preparadora Miriam....nunca he tenido una profesora que me haya motivado tanto a aprender y luchar por tus objetivos. Es muy cercana, atenta, dispuesta siempre a resolver dudas y lo más importante es que sus explicaciones en clase son la bomba. Eres capaz de salir de sus clases comprendiendo leyes que si las lees por encima en tu casa no entiendes ni dos líneas!!!!',163),(55,110,4,'En mi primer año de oposiciones para Educación Física no he podido estar más cómodo. Trato genial y muy atentos constantemente. Mención especial a Pablo mi preparador, el cual recomiendo al 200%. Gran equipo!',164),(56,110,1,'Ha sido decepcionante antes de comenzar. Pagué 80€ para reservar mi plaza, por motivos personales no puedo estudiar este año oposiciones. He pedido la devolución del dinero con el justificante de la transferencia y esta ha sido su respuesta: \"Desde primera hora se han aceptado unas condiciones, al realizar la reserva nosotros nos comprometimos a guardar una plaza y lo hemos hecho. Por lo tanto, por todo lo expuesto en el correo informativo en el que se expone todo, no procede a la devolución de la reserva.\"',165),(57,110,5,'Esta academia es, sin lugar a dudas EL MEJOR sitio para preparar oposiciones, en todos los aspectos. Nada más entrar vas a ser recibido por Alicia y Luis (los propietarios, que te harán sentir como en casa), y a los que nunca les falta una gran sonrisa. Y mi preparador, Jose, de Física y Química, simplemente espectacular. Es capaz de sacar lo mejor de ti y nunca le falta una palabra de ánimo y aliento. Me siento muy afortunada de haber elegido esta academia con un personal tan competente, profesional, y sobre todo, con tantísima calidad humana.',166),(58,111,4,'Sin duda el mejor preparador de oposiciones para los cuerpos de auxilio, tramitación y gestión de Málaga, perfecto sistema de control de estudio e inmejorable aplicación informática para la realización de test y exámenes practico',167),(59,111,5,'Elegí esta academia por sus reseñas anteriores y obviamente no podía dejar pasar por alto mi experiencia en ella. Me he preparado las opos de categorías  administrativas  para el SAS habiendo obtenido muy buenos resultados en ambas por lo que seguramente obtenga mi plaza. Miguel, ha sido mi preparador es una persona super cualificada académicamente por lo que te explica el temario a la perfección e insiste una y otra vez en lo que más \'cuesta\' para que adquiramos los conceptos sin dudas, ni malas interpretaciones. Por otro lado, Miguel trabaja en el SAS desde hace muchísimos años ,unos 25...dato para mí super importante pues nos ha dado una visión interna e importante de como funciona todo ( ya que lo conoce muy bien y en la actualidad ejerce su nombramiento en una categoría del grupo A1, habiendo obtenido y trabajado en diferentes plazas con anterioridad ). En resumen, me decante por Pirandello por el perfil que tenía Miguel, a nivel académico como profesional dentro del SAS. Y por último, destacar el cariño y la cercanía de Alicia, es una academia super familiar y profesional en todos los sentidos, te ofrecen muchísimas facilidades. Mil gracias por todo:)',154),(60,111,4,'Estupenda academia que ha logrado ser una gran herramienta para poder haber conseguido mi plaza de policía local. Tengo que felicitar a Alicia y a Luis por el estupendo trato que dan a todos los alumnos desde el minuto uno que conoces la academia hasta conseguir el deseado objetivo. Por otro lado, agradecer a los grandes profesionales que preparan la oposición como son Juan y Manolo, que preparan la parte de supuestos y derecho, que nunca me olvidaré. Sin ellos seguramente no podría haber conseguido mi sueño, y estaré siempre agradecido. También debo agradecer la labor de Jesús como psicólogo que prepara la parte de psicotecnicos y entrevista, una parte igualmente importantísima en la oposición, siempre atento a la hora de guiarte y facilitarte todo lo que necesites para seguir luchando.',155),(61,111,3,'Estuve buscando academia para preparar por primera vez oposiciones para secundaria, especialidad Geografía/Historia. No tenía ninguna experiencia previa, y la verdad que despues de 3 meses tengo que decir que estoy muy contento. María, la preparadora de esta especialidad, me dio mucha confianza desde el principio. Es una gran profesional, que se preocupa por los alumnos, hace las clases realmente muy agradables, y tiene una gran capacidad didáctica, además el material que nos proporciona es de una gran calidad. Muy contento de haberme decidido por esta academia.',156),(62,112,5,'Llevamos solo unos días mi pareja y yo, pero decir que el trato de todos es magnífico, estas como en casa , con gente muy profesional deseando ayudarte en todo, me costó mucho decidirme por un gimnasio pero tengo claro que he escogido el mejor!',157),(63,112,4,'Es un Gimnasio estupendo,cerca de mi Casa y Monitores fantásticos que te indican los mejores Ejercicios para que cada persona los realice bien,el ambiente dentro es muy bueno,yo lo recomiendo con un 10.',158),(64,112,4,'Recomendadísimo. El gimnasio está muy bien equipado, los monitores te ayudan mucho y te explican cualquier duda o ejercicio de muy buen rollo. Además el ambiente es muy bueno y la gente va a entrenar en serio, se agradece no tener gente ocupando máquinas mientras chatean media hora con el móvil. Yo me cambié del Go Fit a este gimnasio y es la mejor decisión que pude tomar, da gusto entrenar aquí.Lo recomendaría a todo el mundo sin dudar.',159),(65,112,5,'Genial! Me encanta este gim, tanto las máquinas, cuanto los monitores, son muy amables están muy pendiente de ti y te ayudan cuando lo necesitas, (Lucia muy atenciosa) te dan un chute de energía con su positividad y fuerza que tu mente se viene arriba. Para mí eso es súper importante a la hora de elegir un gimnasio.',160),(66,113,4,'Estoy  super contenta dar con el',161),(67,113,5,'He estado en algún gimnasio que otro, pero como este ninguno llevo ya tiempo y no lo cambio por ningún otro!! Y respecto al dueño todo de 10 atento siempre y dispuesto a ayudar!??…',162),(68,113,5,'Trato inmejorable, y fantástico profesional. Ideal para ponerse en forma en un buen ambiente.',163),(69,113,4,'Vamos, si quieres adelgazar, o ponerte en forma, tienes que venir, completo, no está agobiado de gente, te ayudan, a mí me encanta',164),(70,114,5,'Un box genial! En él se pueden cunplir todos los retos que tengas, siempre ayudados de un gran coach! También es muy grande y espacioso, por lo que se puede entrenar sin problemas. Además de eso, y aparte del CrossFit, las distintas clases de halterofilia, open box o yoga hacen que siempre tengas ganas de ir!!',165),(71,114,4,'He empezado hace poco a hacer Crossfit y elegí este box porque desde el primer contacto con ellos fueron súper atentos. Muy buen ambiente y genial el trato de los entrenadores que siempre te ayudan a aprender y seguir mejorando. Recomendado al 100%.',166),(72,114,4,'Sitio perfecto, tanto para empezar en la práctica del crossfit como para continuar avanzando si ya lo has practicado, monitor Level 2, que siempre esta pendiente a tu técnica y como mejorarla.',167),(73,114,4,'El lugar idóneo para la iniciación y la práctica del crossfit. El monitor siempre está disponible y pendiente para cualquier duda o corrección y el ambiente es excelente. Muy recomendable.',154),(74,115,5,'Buen centro deportivo,bien equipado,en el que las monitoras ,Cristina y Lidia, realizan un trabajo excepcional con entrenamientos adaptados para todos los niveles y necesidades. Muy contenta con mi experiencia.',155),(75,115,5,'42 minutos de ejercicio intenso que pasan volando. Las clases son muy dinámicas y las coach se adaptan a tu nivel. Muy recomendado.',156),(76,115,4,'Muy indicado para entrenamientos funcionales más personalizados y si tienes poco tiempo para ir al gimnasio. Muy interesante para aquellas personas como yo que le aburre el gimnasio como tal de levantar pesas y busca entrenos variados y para todo el cuerpo como complemento de otra actividad deportiva como el running. Entrenos variados. Monitoras/entrenadoras muy buenas y motivan mucho. Relación calidad/precio buena.',157),(77,115,5,'Lidia es una monitora estupenda, te corrige, ayuda y motiva en cada momento. Tenemos suerte de entrenar con ella',158),(78,116,1,'Hay cucarachas en el spa, el agua está turbia y está tan sucio q el moho crece por las paredes.En 5 meses como socio, los baños turcos estaban cerrados más d dos meses y cuando lo arreglaron lo tienen apagado casi todo el tiempo, el techo se les cae y no lo arreglan, encima no solucionan ningún problema o algo q necesites, el cliente es lo último en O2, lo he vivido.En recepción se pasan el balón, todo son excusas pero pasa el tiempo y el moho y las cucarachas crecen, tocas algo y está mugroso, se ven las manchas negras claramente y los vestuarios…secadores rotos, duchas negras d moho, no hay papel y las taquillas no las limpian jamás! Una gran decepción O2 con lo cara q es la cuota se aprovechan del cliente.',159),(79,116,5,'Pasamos en familia unas horas estupendas en las piscinas y baños del centro. Todo muy limpio, la temperatura muy buena. Fantástico para relajarte y darte algunos masajes con los diferentes chorros de los baños. Absolutamente recomendable. Llevate chanclas, gorro de baño y candado para el vestuario.',160),(80,116,4,'Las instalaciones 02 Malaga son muy buenas.',161),(81,116,4,'El centro está genial. Muy bien equipado con una gran variedad de máquinas de musculación. Los técnicos son eficientes y muy amables. Como contra  añadir que no hay piscina en agosto hasta el día 22. Aunque el Spa sí está operativo. Gym recomendable. Buenas tarifas en este mes.',162),(82,117,3,'La instalaciones en si están muy bien, hemos sido usuarios durante unos años,.pero ahora está muy muy masificado, la sala de máquinas siempre tienes que esperar o compartir, y en algunas clases dirigidas entra más gente de la que debería.',163),(83,117,2,'Yo me gustaría ser socio, ya lo fui en la delegación de Huelva capital a la que voy con mucha frecuencia pregunté si podía combinar y solo dejan 3 días al mes, o sea solo entrenaria dos semanas, no entiendo por qué no se puede usar para poder entrenar 24 días al mes',164),(84,117,5,'Aunque las instalaciones se han quedado pequeñas para la afluencia de gente he de decir que mi hija y yo nos hemos mantenido en el gimnasio sobre todo por la cercanía,implicación y preparación de su personal,en especial los monitores de natación Juan y Cristian ,creo que la empresa debería de cuidarles mucho,si se van',165),(85,117,5,'Gran gimnasio!!. Monitores atentos, limpieza, canchas mantenidas y aseos bien cuidados. Entrenar aqui es otro nivel!',166),(86,118,5,'Sitio agradable, buenas máquinas, dos salas para actividades y personal muy agradable y profesional, altamente recomendable',167),(87,118,2,'Soy estudiante, este año terminó la carrera y vuelvo a casa, cuando me apunté me dieron una tarjeta para poder rntrar, con una fianza de 2€, ayer me hincho de ir al gimnasio a devolver la tarjeta y que e devuelvab mi fianza y la chica del mostrador me dice que no, que ya no devuelven los 2€, al final no me devolvió el dinero y decía que no me devilvia la tarhtar, no es el dinero, son las formas , muy descontenta',154),(88,118,5,'Instalaciones muy cuidadas, gran variedad de aparatos y muy buen ambiente. Mención aparte los monitores… un 10 para Inma y Pablo',155),(89,118,4,'Creo que, en general, es un buen gimnasio, pero los precios son realmente altos, el doble del precio en Dinamarca, como 70 euros el primer mes y después, como 45 euros si quieres estar disponible para entrenar todo el día. Incluso si el precio es alto, cierran muy temprano los fines de semana y cierran los días festivos. También es muy concurrido y pequeño. Una cosa muy buena es que mantienen el lugar limpio y ponen las pesas en el lugar correcto cada noche cuando cierran.',156),(90,119,5,'Por fin he conseguido un sitio con clases variadas, cerca de casa (y si vives lejos con paradas y entrada de Autovía cerca) entrenadores súper atentos que se preocupan hasta por aprenderse tu nombre, a lo que haces y a corregirte malas posturas. Estoy súper motivada, iba dos veces a la semana y ahora tres. Feliz de haberles encontrado ❤',157),(91,119,5,'Es genial para personas que quieran entrenar y hacer una actividad divertida y entretenida.',158),(92,119,4,'Mi experiencia de 10!!!',159),(93,119,5,'Me encanta este gimnasio,son todos muy educados,los monitores son muy simpáticos sobre todo Lucia.Un placer ponerse en forma en este gym.?…',160),(94,120,5,'La colección privada extraordinaria, variada y muy buen cuidada. ',161),(95,120,4,'Nos gustó muchísimo, museo bien cuidado y con una exposición exquisita.',162),(96,120,5,'Verdaderamente un museo bastante desconocido, el contenido del mismo acompañado de trajes de epoca, no te deja indiferente. Es un museo aunque parezca mentira de carácter particular o privado, tuvimos la ocasión de conocer al promotor de este museo, comentando que el coste del mismo corre a su cargo. Lo felicitamos por el material expuesto. Un lugar a visitar en la ciudad.',163),(97,120,5,'Un buen museo para pasar la mañana o la tarde, gran variedad en la exposicion. Muy interesante',164),(98,121,5,'Es un museo digno de alabar. Acceso gratuito a un contenido muy interesante de arte contemporáneo. Además, el espacio renovado es muy interesante como continente de exposiciones que van cambiando. No puede faltar en tu recorrido.',165),(99,121,5,'El CAC es una gran alternativa cultural y de ocio por su gratuidad y su contenido. En nuestro caso fuimos a ver la exposición de Joan Cornellá, y fue genial. La exposición es tan divertida como crítica y dolosa a partes iguales, consigue que rías y reflexiones a la vez. Es imposible no ver toda la colección entera una vez estés dentro, muy recomendable.',166),(100,121,5,'Museos gratis mantenidos con dinero público es lo recomendable. Este tiene buenas obras entre otras impresentables. Pero...para gusto los colores',167),(101,121,4,'Un museo gratuito para conocer el.qrte contemporáneo es necesario. Nos ha encantado',154),(102,122,5,'Interesante museo sobre la artes y costumbres populares en Málaga. Recomendable concertar visita guiada, si es posible.',155),(103,122,5,'Museo que inesperadamente me sorprendió, pues por su ubicación no esperas un edificio con tanta historia entre tanta modernidad, cómo si congeláramos un pedazo de historia y permaneciera igual que antaño.',156),(104,122,4,'Muy interesante.',157),(105,122,4,'Es como viajar en el tiempo. Lo único que no me gustó, fue que de mi infancia  recordaba un bonito traje de malagueña goyesca que me hacía ilusión volver a ver y cuando llegué, zasca! habia uno horrible de flamenca. Quien lo cambió? Con qué propósito? Espero volver y poder ver aquel maravilloso traje',158),(106,123,5,'Hermano pequeño del Museo Thyssen de Madrid, es uno de los mejores museos que hay ahora mismo. La colección permanente es una maravilla, al igual que las exposiciones temporales, y tras la visita, tomarse un café en el jardín interior que tienen. Merece mucho la pena visitarlo.',159),(107,123,5,'Una visita obligada. Bonita colección de pinturas no muy antiguas, casi todas de autores españoles como Sorolla, Julio Romero de Torres y Fortuny. Los domingos a partir de las 16:00 es gratis. Son cuadros con realismo, pinturas de paisajes y actos normales que te llegan a transportar un siglo atrás. Se pueden ver paisajes de lugares andaluces y otros como Mallorca y la Playa de la Concha. Celebraciones como ferias andaluzas y la Semana Santa... Me impresionó uno muy grande en el que se avecinaba un naufragio.',160),(108,123,4,'Han sido varias porque me encanta en día laborable y en dias festivos en Mayo 2023 hice dos visitas una para el museo ?️ visita guiada y otra el día de la danza y fue maravilloso',161),(109,123,4,'Excelente museo de la ciudad de Málaga. Las muestras permanentes y temporales son muy buenas. La atención también y el domingo cabe la posibilidad de entrar de forma gratuita. Las instalaciones sobretodo del piso superior es hermosa. Los techos de madera labrados, inspiradores. Un lugar para visitar de forma recurrente en pleno centro de la ciudad.',162),(110,124,5,'Es un pequeño museo ubicado en un callejón a la espalda de la catedral de Málaga en una casa colonial muy bien restaurada y conservada, esta limpio.  La exposición es del artista Revello de Toro las obras las  tienen muy bien organizadas, iluminadas y con su respectiva descripción a un lado. Tiene ascensor, una pequeña biblioteca y un altillo muy chulo. El personal es amable y atento, con la entrada incluye la audioguia.',163),(111,124,5,'En el entorno de la que fuera casa y taller del escultor Pedro de Mena,del siglo XVII y en el corazón del centro histórico de Málaga,el museo Revello de Toro aúna una extraordinaria colección de dibujos,bocetos y óleos de este pintor malagueño con el marco del edificio donde se exponen en una perfecta conjunción de ambos.Magnífica iluminación y presentación de las obras y detalladas explicaciones que,junto con una muy buena atención,hacen que este museo sea un orgullo para la ciudad y los malagueños.',164),(112,124,4,'Me gusta mucho la pintura de Revello de Toro, y me encanta el edificio del Museo.',165),(113,124,5,'Un museo que debes de visitar si vas a Malaga.',166),(114,125,5,'Un modo divertido de que los niños vean para qué sirve lo que están estudiando de física y química, óptica, lógica... vamos, que se exprimen un poco el cerebro. Está muy orientado a los institutos, aún así sigue siendo interesante para cualquier edad. Los profesores del Centro hacen que la visita sea mucho más entretenida. Procuran hacer que las visitas sean lo más personalizadas posible y que todas tus dudas sean resueltas. Si tienes dos horas debería ser parada obligada. Es pequeño y ese es su único punto débil.',167),(115,125,4,'Una experiencia inolvidable. Muy entretenido y educativo. Hacen experimentos en vivo. El planetario lo explican en directo el personal del propio centro.',154),(116,125,5,'Muy recomendable asistir a la sala de experimentos. En la sala de módulos interactivos hay gran cantidad de módulos para aprender y practicar sobre diferentes temáticas. También recomendable entrar en el planetario. Otra de las actividades recomendables son las noches de astronomía (imprescindible reservar previamente)',155),(117,125,5,'Los peques disfrutaron muchísimo celebrando allí el cumple de mi hija. La Sala, los experimentos. El Planetario es algo para más adultos puesto que lo que explica los peques de 10 años se perdían pero en general muy bien. Gracias a las personas que lo llevan, fueron super amables, atentas y muy profesionales.',156),(118,126,3,'Parece más un pequeño museo sobre Picasso y primero sus diez años en Málaga y su posterior relación con la ciudad, que una verdadera casa Museo, ya que no tiene la configuración de la casa original, solo se musealiza como tal el comedor pero no parece que tenga ni la disposición ni los muebles originales.',157),(119,126,5,'Era \"la noche en blanco\", día en que los museos son gratis de 7 de la tarde hasta 1 de la mañana. Había también muchos espectáculos de musica gratuita por la ciudad. La Casa Natal de Picasso está bien. Había mucha cola para entrar.',158),(120,126,5,'Muy interesante, lo disfrutas así no seas experto en arte. Te brindan audioguías que son una ayuda perfecta. Precio 3€. Pagas 1 € más y tienes acceso a la exposición a media manzana de ahí.',159),(121,126,4,'Muy interesante el museo, que te descubre la historia familiar de Picaso. La influencia de su padre, pintor. La influencia de Málaga y el Mediterráneo, que es la luz. Sus primeras pinturas, de niño. Es impresionante pensar que ahí nació un genio.',160),(122,127,3,'La exposición permanente puede llegar a ser interesante por varias de las obras expuestas. Pero en las dos ocasiones que lo visité la exposición temporal no me llamó la atención en absoluto; la primera vez era una exposición de Joan Miró, la segundo de Lucio Fontana, al que no conocía, y que tampoco me ha ofrecido nada artísticamente. El museo en sí está bien organizado, pero creo que hay mucho espacio desperdiciado, ya que hay muchas zonas que se podría llenar con más obras. Desde mi punto de vista, puede ser recomendable verlo, si te gusta en exceso este tipo de arte, si no es así, pienso que hay museos mucho mejores en la provincia.',161),(123,127,5,'Unas modernas instalaciones en el extremo del puerto de Málaga. Hay un espacio para exposiciones temporales (la que vi en mi visita fue una sobre Lucio Fontana) y otro para la colección permanente que se va renovando periódicamente (con autores contemporáneos). Una buena visita para amantes del arte actual.',162),(124,127,5,'Un regalo para los sentidos. Si te gusta este tipo de arte merece realmente la pena. Ya había estado en el Centro Pompidou en París y, aunque este es pequeñito, es un lujo poder tenerlo aquí en España. Y la tienda es un cofre del tesoro... Si eres una apasionada de los libros te va a costar no salir de allí con una maleta llena de ellos. Yo me he quedado con 4 y porque me daba miedo que no me los llevara la maleta en el viaje de vuelta, sino... Y todo el personal del museo y de la tienda, de 10.',163),(125,127,4,'A pesar de entrar gratis por mis estudios, considero que el precio de la entrada es excesivo en comparación con otros museos 