nsulta.',163),(265,45,1,'No dudo de la profesionalidad de los fisioterapeutas que haran un gran trabajo (me quedare con la duda), pero si una señora de 84 se pega 20 minutos andando desde su casa sin poder casi andar para preguntar si sus tratamientos le puede mejorar su dolencia le atienden en la puerta y se limitan a decirle que coja cita por whatsapp (que ni tiene) sin preguntarle ni que desea, entiendo que debe coger la cita y ya pregunta si eso, porque el telefono tampoco lo cogen... Un diez en atencion, Gracias',164),(266,45,5,'Sin duda la mejor Clínica de fisioterapia de Málaga, calidad y precio al alcance de cualquiera, metodología avanzada a la última y un gran trato humano, he acudido con multitud de lesiones en todos estos años y siempre he tenido una solución o un tratamiento adaptado para la recuperación más rápida posible, recomendable 100%.',165),(267,45,5,'Un trato de 10 muy profesionales tanto a mi como a mi hija de 7 años nos han tratado de lujo y el tratamiento un 10. Buenos medicos,buenos fisios. Buena limpieza en general muy contenta de haberos elegido. Todos son los mejores no hay ninguno que se que atrás. Gracias equipo por vuestro trato lo recomiendo un 200 por cien. Me toco Laura Triguero encantadora y superprofesional en general mil gracias',166),(268,45,4,'Muy buen servicio. Fui por molestias en las cervicales y he salido muy contenta. Me ha atendido Laura y el trato no podía ser mejor. Después de la sesión, me explicó ejercicios que podía hacer para mejorar la postura y no tener dolores de espalda. Sin duda, volveré.',167),(269,47,5,'Después de meses con molestias y tras pasar por diferentes clínicas sin que me solucionaran los problemas que arrastraba aquí supieron dar con la tecla desde un primer momento, además de utilizar en las sesiones diferentes herramientas para favorecer la recuperación me indicaron una serie de ejercicios para realizar en casa y acelerar el proceso además de no recaer. A día de hoy he vuelto a correr sin molestias y lo que es más importante, poder disfrutar del deporte y del día a día sin molestias Especial mención a la chica que me trató (Maria de la O), muy implicada en todo momento con la recuperación y el seguimiento del proceso, sin duda una gran profesional que además cuenta con unos medios de última generación.',154),(270,47,5,'Yo he estado varias veces para varias dolencias: molestias en tendón de aquiles, en el empeine, una tendinitis en la ingle y es que te arreglan, tienen muchas máquinas y muy buena gente y profesionales.',155),(271,47,4,'Magnífica experiencia. Me están tratando de una operación de prótesis de hombro y me atiende Fran. Todo marcha estupendamente y en la revisión mensual del traumatólogo está admirado de mis progresos y mi recuperación dada además mi elevada edad. En la última consulta me llegó a grabar en vídeo mis progresos para ponerlos como ejemplo. Estoy encantado con la clínica, su personal y sobretodo FRAN.',156),(272,47,4,'Muy buenas instalaciones con las máquinas mas modernas. El personal muy profesional con muy buena atención al paciente. Todo el equipo es muy top con una mención especial a Alejandro y Maria.',157),(273,50,5,'Muy profesionales. Mucha seriedad. Rapidez y trabajo bien realizado. Han cumplido los plazos al 100% tanto en la fecha de inicio como en la de finalización. Calidad precio inmejorable. Lo recomendaría sin ninguna duda.',158),(274,50,5,'El equipo de reformas me realizó la reforma integral de un local comercial. Una reforma desde 0 que sin duda superó mis expectativas. Son un equipo humano espectacular , y de eso hoy en día hay muy poco. Sin duda dejaría en sus manos cualquier tema relacionado con sus competencias, de las cuales son unos profesionales. Cómo digo el proyecto ha superado las expectativas y todos hemos quedado muy satisfechos con el trabajo. Y no solo me llevo una empresa en la que confiar, Joaquín y Carlos , y todo su equipo son unas muy buenas personas.',159),(275,50,5,'Sin duda hemos tenido buena suerte dando con esta empresa. Joaquin y Carlos son dos buenos profesionales y buenas personas, que también es importante. Estamos encantados con los resultados obtenidos, nos han colocado una puerta acorazada, ha quedado perfecta. Ya les hemos pedido presupuesto para realizar algunas cosas más para reformar en nuestro piso. Si buscáis una empresa profesional, con experiencia que no os de quebraderos de cabeza y en la que podías confiar, os la recomendamos. Gracias por todo!',160),(276,50,1,'Empresa de reformas lamentable.',161),(277,51,5,'Estamos muy contentos de haber hecho la reforma de nuestra casa con Javier y su equipo: baños, unir cocina con salón, tarima flotante con nivelado de suelo, la escalera a juego, electricidad, puertas, etc. Ha quedado todo perfecto. Javier nos dio buenas ideas y consejos en todo momento. Es detallista, se preocupa porque todo quede bien. Además cumplieron los plazos, algo complicado en el mundillo de las reformas.',162),(278,51,5,'Javier de Reformas Integrales Málaga ha hecho nuestro sueño realidad. Teníamos una vieja cocina muy estrecha y anticuada. Con sus expertas manos hemos conseguido una cocina abierta que se integra perfectamente con el salón. Además nos ha ejecutado la conversión del lavadero en un aseo, que nos ofrece un gran desahogo. Los materiales y la ejecución de obra no ha podido ser mejor. El trato y el interés que nos ha brindado ha sido excelente. A cada problema que se presentaba, ha sabido resolverlo de forma sobresaliente. Lo recomiendo por los acabados y la profesionalidad.',163),(279,51,4,'Un acierto elegir esta empresa . No ha sido fácil reformar totalmente una casa de 2 plantas , terraza , garage , patio . Javi ha sabido con su capacidad resolutiva coordinar perfectamente todo y junto a su equipo dar soluciones efectivas , y todo eso con un trato exelente , comprensión y educación .Recomendable cien por cien .',164),(280,51,5,'Quiero destacar, en primer lugar, al equipo de profesionales que ha realizado la reforma de nuestros baños, en particular a Javier, una persona extremadamente meticulosa a la hora de realizar cualquier trabajo. En él ha recaído la mayor parte de la reforma. Desde el primer momento, Javier nos ha orientado en el diseño y en todos los aspectos esenciales a tener en cuenta. Siempre ha habido una buena comunicación y nos ha indicado cualquier modificación que pudiera surgir para que nosotros le diéramos el visto bueno. Además de estar comprometido con su trabajo, es una excelente persona que siempre ha estado atenta para resolver cualquier problema que pudiera surgir.',165),(281,52,5,'Nos decidimos por esta empresa para la reforma de la cocina y del cuarto de baño. Muy buen servicio y siempre atento a que todo fuera como debe de ir. También nos arregló un problema en el tejado, después de un año la reforma sigue intacta, sin duda un muy buen trabajo.',166),(282,52,4,'Conté con esta empresa para la reforma integral de mi casa después de valorar entre otras. Estoy muy contenta con el trato recibido de Dani y todo su equipo. Son gente muy atenta y sobre todo resolutiva.  La recomiendo para cualquier trabajo de reforma.',167),(283,52,4,'Hace unos meses hice una reforma en mi piso , y estoy encantada con el trato , profesionalidad y me aconsejaron en todo momento y no dudaré en volver a llamarlos. Si estás pensando en hacer reforma en casa como en mi caso los recomiendo do 100%. Calidad, precio inmejorable .',154),(284,52,5,'Excelente trato, me dieron presupuesto sin compromiso. Cuando realizaron el trabajo se preocuparon por todos los detalles y muy contento con el resultado final. Recomiendo a todos los que estén interesados en hacer una reforma ponerse en contacto con ellos. La próxima reforma que tenga que hacer lo tengo claro.',155),(285,53,5,'Tuvimos que reformar una vivienda que acabábamos de adquirir y queríamos una empresa que gestionara todo, solución llave en mano. Contactamos con ellos porque ya habían hecho varias reformas a un familiar y nos 