mente agradecida por el trabajo realizado y no dudaría en volver a contratarlos en el futuro.',160),(290,54,4,'En nombre de mis padres os queremos dar la enhorabuena por el servicio prestado para reformar nuestra casa de la playa en Fuengirola.',161),(291,54,5,'Contacté con esta empresa, a través de una amiga.Y desde luego, viendo sus reformas que me encantó...me animé: y estoy supercontenta!!! Profesional, puntual , eficaz y feliz con el resultado!!!!!',162),(292,54,5,'Buena experiencia son muy profesionales.',163),(293,56,5,'Trabajos de gran calidad y presupuesto acorde con los materiales, tiempos de ejecución perfectos y muy satisfechos en general, muy recomendables.',164),(294,56,1,'Muy poco formales. Me dieron un presupuesto que acepté, después de ir varias veces para confirmar la fecha de inicio del trabajo y concretar un día, llamo dos días antes para recordarselo y me dicen que no es posible comenzar ese día. Me dan una nueva fecha y vuelven a retrasar el trabajo. Termino por buscar a otro. Día 12/11/2019 Primero. Cómo voy a pagaros si no formalizasteis ninguna fecha de inicio. Segundo. Creo que después de mas de un año es un poco tarde para responder a mi queja. Tercero. Reconocer el error por su parte a estas alturas hubiese sido mas profesional.',165),(295,56,5,'Esta empresa lleva más de 15 años en el sector Victoria, Cristo Epidemia y Olletas, seriedad y experiencia en reformas integrales. Ha realizado más de 250 reformas con una satisfacción óptima al cliente.',166),(296,56,5,'Muy buenos profesionales, me han dejado mi casa totalmente nueva muy contenta con el gran trabajo.',167),(297,57,5,'Trabajos muy profesionales,buen servicio y mejor trato.Muy recomendable.',154),(298,57,5,'Todo profesionalidad y bien hacer',155),(299,57,4,'Reforma del baño profesional.',156),(300,57,5,'BUENOS PROFESIONALES,ME HAN DEJADO LA COCINA ESTUPENDA!!!!, MUY SATISFECHA POR HABERLOS ELEGIDO,LOS RECOMIENDO,BUENA RELACIÓN CALIDAD/PRECIO.',157),(301,58,5,'Muy buenos profesionales, me han dejado mi casa totalmente nueva muy contenta con el gran trabajo.',158),(302,58,5,'Muy buen trato desde el inicio en la oficina, hasta la finalización del trabajo. La siguiente reforma volveré sin dudar.',159),(303,58,4,'Trabajos muy profesionales,buen servicio y mejor trato.Muy recomendable.',160),(304,58,1,'Profesionalidad 0.... Tras concretar fecha de inicio de la reforma y contactar con ellos unos días antes, ya que no teníamos noticias de ninguna, nos dicen que no pueden y nos retrasan la fecha de inicio. Interes ninguno, ni que nos fueran a regalar el trabajo!! 12/11/19 pero si ha pasado un año, la obra está hecha. Cómo íbamos a pagar provisión si no había planes de empezar la obra? Más de un año para responder!!!!!',161),(305,59,5,'Gran profesional y siempre pendiente de los trámites con los organismos pertinentes.',162),(306,59,5,'Totalmente de confianza , muy rápido, muy puntual, disponibilidad total y buena comunicación.Totalmente aconsejable.',163),(307,59,4,'se encargó de un proyecto llave en mano de un local de 200m2 (anteproyecto, proyecto básico, proyecto de ejecución, selección de constructor, project management, certificación final de obra). El contacto con Beatriz y José Manuel ha sido ágil, profesional y agradable. Sin ninguna duda, los contrataré en el siguiente proyecto. MUCHAS GRACIAS!!!!',164),(308,59,4,'Muy buen resultado de sus gestiones .',165),(309,60,5,'Llamé y al día siguiente han hecho el certificado de eficiencia energética. Quién vino a casa fue muy profesional y amable. Recomiendo la empresa. Muchas gracias por vuestra labor.',166),(310,60,5,'José Manuel muy profesional muy contenta con su trabajo lo recomiendo al 100%',154),(311,60,4,'Brutal. Contacté porque necesitaba el certificado de eficiencia energética, y al día siguiente vinieron a hacer la visita y toma de datos. Al día siguiente de la visita ya lo tenía en mi email. 2 días! Recomiendo a esta Arquitectura. Contactaré en futuras ocasiones si fuera necesario sin dud